INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (1, N'Plataforma DEISI - Gesto de TFCs', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Continuar o trabalho j desenvolvido na plataforma de gesto de TFCs para incluir novas funcionalidades: upload dos relatrios e outros artefactos; agendamento das apresentaes intermdias e finais; registo das avaliaes intermdias e finais; notificaes; etc. A aplicao foi desenvolvida em Java usando a framework Spring. O objectivo  integrar as novas funcionalidades j no prximo semestre. Este trabalho  para ser desenvolvido por um aluno.', NULL, N'Atribuido', NULL, N'DEISI1', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (5, N'Content-Based Music Information Retrieval', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Apresentar uma soluo algortmica e metodolgica para problemas de recuperao de informao musical baseada em contedo, e outras sugestes (por exemplo, notao musical e representao simblica) e/ ou espectro de especificidade de similaridade de udio.', 1, N'Indisponivel', NULL, N'DEISI5', NULL, 0, N'p3478', NULL, N'p3478', 0, NULL)
