INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (17, N'Plataforma Gesto de Requisitos', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao de gesto de ciclo de vida de requisitos utilizando abordagens SCRUM e AGSI-Arquitectura da Gesto de Sistemas de Informao e descrio de requisitos em template a fornecer por orientador
Trabalho enquadra-se em projecto mais amplo, visando a integrao com ferramentas de gesto de projecto (e.g.: VSTS, MS-Project, projectlibre, etc.) e de controlo de verses (e.g.: git) 
Disciplinas listadas no so de obrigatoriedade cumulativa', NULL, N'Atribuido', NULL, N'DEISI17', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (18, N'Interactive query builder', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A soluo a criar dever permitir a um utilizador no conhecedor da linguagem SQL criar relatrios a partir de um base de dados a que lhe seja dado acesso, podendo imprimi-los ou exporta-los para ficheiro externo
O TFC continua trabalho anterior que j executa queries elementares com SGBD MS-SQL e MySQL, com exportao em formato MS-Excel e XML
Nesta fase, pretende-se desenvolver interface grfico, aprofundar construo de queries, permitir impresso e acrescentar o SGBD PostgreSQL', NULL, N'A Aguardar Atribuio', NULL, N'DEISI18', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (19, N'Geoplacement (controlo de presena electrnico)', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Soluo de validao de presena e acesso a espaos controlados utilizando dispositivos de comunicao moveis pessoais. 
Composta por 2 elementos:
1. Marcador fsico colocado no local onde se controla presena e acesso (alternativa com emissor Beacon);
2. Aplicao mvel para ler o marcador/emissor e registar leitura em base de dados central, aps validar geolocalizao.
Nesta fase do trabalho, no  requerido desenvolvimento de BackOffice, mas pode se desenvolvido para como PoC. ', NULL, N'Atribuido', NULL, N'DEISI19', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (20, N'Plataforma de subscrio de servios', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Construo de um ecossistema colaborativo em formato crowdsourcing, destinado a entidades da Economia Social, suportado por uma plataforma de subscrio de servios, disponibilizados em formato de partilha de tempo  e operados segundo um modelo de funcionamento sem vinculo permanente entre entidades e pessoas participantes.
O presente TFC tem por objecto definir o modelo conceptual para o Ecossistema e a construo de um PoC  para validao do mesmo.', NULL, N'Atribuido', NULL, N'DEISI20', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
