INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (43, N'Redes Neuronais Artificiais como auxiliar na teraputica e acompanhamento clnico de doentes com a leso aguda renal.', N'2018', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de um algoritmo com base no conceito de Redes Neuronais Artificiais como auxiliar no diagnstico e tratamento de doentes com leso aguda renal, baseando-se num conjunto de dados biomdicos. O modelo permitir criar um sistema de diagnstico, fundamental no que concerne  terapia mais adequada, representando uma vantagem em termos de rapidez nos tratamentos e poupana de recursos tcnicos e humanos. A proposta ter o acompanhamento do Prof. Francesco Costigliola.', 10, N'Atribuido', NULL, N'NDEISI43', NULL, 0, N'p4855', N'p4855', N'pnd2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (44, N'Desenvolvimento de ferramentas de procura de molculas com aco farmacolgica atravs de tcnicas de data mining e machine learning', N'2018', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Actualmente, a procura de novos frmacos tem merecido bastante interesse por parte dos grupos de investigao na rea da biomedicina. O projecto que ter o acompanhamento do Professor Francesco Costigliola, visa desenvolver um sistema de anlise, classificao e associao de molculas com possvel aco teraputica, tendo por base dados experimentais obtidos por espectroscopia de infra-vermelho, utilizando-se para o efeito as ferramentas de data mining e machine learning mais adequados.', 10, N'Indisponivel', NULL, N'NDEISI44', NULL, 0, N'p4855', N'p4855', N'pnd2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (45, N'Carlos Relvas Full 3D. The Stereo Catalogue', N'2018', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Este projecto de investigao procura apoio informtico (programao e design web) para a criao de um catlogo digital online de fotografias a partir de uma base de dados. O objectivo  combinar as fotografias estereoscpicas de Carlos Relvas (negativos e positivos) que se encontram dispersas em diferentes coleces pblicas e privadas.
Um dos catlogos online de fotografia antiga a ter em conta  o do fotgrafo W.H. Fox Talbot: https://talbot.bodleian.ox.ac.uk/search', 10, N'Atribuido', NULL, N'NDEISI45', NULL, 0, N'p5404', N'p5404', N'pnd3', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (46, N'Compilao, Verificao e Validao contnua de software de Espao', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A Agencia Espacial Europeia tem a decorrer um conjunto de misses (e.g. "Space Rider"), em que a GMV  responsvel pelo software de bordo.  Todo software executado no espao  submetido a um processo de "qualificao" que consiste num conjunto de normas e testes que garantem o seu funcionamento. Neste TFC  proposto a automatizao parcial do processo de qualificao implementando uma rotina, que, por ex., todas as noites, corre um conjunto de testes sobre o software armazenado num repositrio.', 17, N'Indisponivel', NULL, N'DEISI46', NULL, 0, N'p5403', NULL, N'p5403', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (47, N'Sistema de ticketing (pedidos de assistncia) para a empresa Rodoviria de Lisboa', N'2018', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de uma plataforma para gesto de tickets, relativos a pedidos de suporte da rea de IT, constituda por uma aplicao mvel e uma aplicao web que comuniquem entre si. Os pedidos criados so reencaminhados para os responsveis das reas e um dos elementos da equipa de IT aloca-se ao pedido. Todo o histrico e evoluo dos pedidos estariam disponveis para consulta. Dever ter uma componente para gerar relatrios de tipo de pedidos, tempo mdio de resposta, entre outros.', 21, N'Atribuido', NULL, N'Aluno47', NULL, 0, N'p4453', N'p4453', N'a21601155', 0, NULL)
