INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (49, N'Gestor de dvidas para controlo interno', N'2018', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Este protejo tem como objectivo agilizar/automatizar o processo de abate de dividas de cada consultor da empresa.  Com isto a empresa pretende ter uma webapp personalizada/costumizada ,feita de raiz seguindo os requisitos da empresa , onde todo o processo de gesto  controlado na mesma.  A recolha de dados da situao financeira  feita atravs do acesso a uma base dados. Para validar qualquer alterao nos valores em divida dever ser feito upload dos devidos comprovativos.', 22, N'Recusado', 10, N'Aluno49', N'a substituir por proposta de empresa', 0, N'p4453', N'p4453', N'a21700075', 0, NULL)
