INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (57, N'Algoritmos genticos aplicados aos video jogos.', N'2018', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N' Com este TFC pretendemos pegar num jogo tower defence estilo "Plants vs Zombies" e aplicar um algoritmo gentico com o objectivo de desenvolver uma Inteligncia artificial e ver at onde a inteligncia desse algoritmo pode chegar. Para atingirmos esse objectivo a ideia  ter dois ambientes de jogo , um para o utilizador e outro para a maquina, em que os inputs do utilizador sero guardados e tratados pelo algoritmo gentico para posteriormente fornecer a informao   maquina.', 10, N'Atribuido', 14, N'Aluno57', NULL, 0, N'p5354', N'p5354', N'a21700924', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (59, N'Simulador de Comparador de Cursos', N'2018', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se criar um programa que compare (atravs das disciplinas, mdias, nmero de cadeiras prticas vs. cadeiras tericas, etc.) cursos dentro de uma Universidade e que devolva uma lista de cursos consoante as preferncias dos utilizadores. Destinado a futuros candidatos  Universidade. ', 10, N'Recusado', 17, N'Aluno59', N'O preponente do tema j tem trabalho atribuido', 0, N'p2703', N'p2703', N'a21507835', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (60, N'Gesto de Condomnios e Anlise de Tarefas', N'2018', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se criar uma plataforma de gesto de condomnios, incluindo estatutos dos condminos.
Gerar actas e recibos pagamento.
Analise de actas, de obras, gesto de conta bancria, contedos da legislao patente nos condomnios e manuteno das reas envolventes.
Previso de alteraes a longo prazo que englobem os condonimos, obras.
Gesto de litigios, e faltas de pagamento, apoio jridico.


', 10, N'Recusado', 17, N'Aluno60', N'Grupo j tem trabalho atribudo (DEISI41 - Gesto de portflio aplicacional )', 0, N'p2703', N'p2703', N'a21507835', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (61, N'Sistema de ranking de Professores e Cadeiras', N'2018', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se com este TFC criar um programa que compare (atravs das universidades, cursos, anos e professores) estabelecimentos de ensino e que devolva uma anlise de professores e cadeiras. Estas avaliaes e anlises so aplicadas ao ME e  prpria universidade.', 10, N'Recusado', 18, N'Aluno61', N'O preponente j tem trabalho atribuido', 0, N'p4671', N'p4671', N'a21501704', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (62, N'Controlo Areo', N'2018', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'A proposta para o nosso TFC consiste na criao de um sistema com Inteligncia Artificial que ir analisar todas as decises tomadas pelos controladores areos num determinado aeroporto. O sistema verificar o risco associado a cada deciso e ir intervir caso seja necessrio. Ir tambm ser criada uma DB onde ser guardada toda a informao dos avies nesse dado aeroporto. Alm disso, ser criado um radar que mostre o percurso dos avies consoante as decises tomadas.', 10, N'Recusado', 20, N'Aluno62', N'Tema substituido', 0, N'p5265', N'p5265', N'a21603256', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (63, N'API de Gesto de Associao Desportiva', N'2018', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de uma API REST (com web tokens) de gesto de uma associao desportiva que visa guardar a assiduidade nos treinos de cada escola associada, pagamentos de cotas (e integrao com paypal), marcao de eventos especiais e broadcast de emails para os associados (todos, ou por categoria) com diversas informaes.', 10, N'Atribuido', NULL, N'Aluno63', NULL, 0, N'p5403', N'p5403', N'a21604600', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (64, N'Loja online', N'2018', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Com este trabalho pretendemos criar uma loja online, onde  nos possvel a compra e venda de artigos', 10, N'Recusado', 21, N'Aluno64', N'Descrio insuficiente, tem que ser reformulado.
Como prazo de proposta de aluno terminou, reformulao ter que ser submetida por orientador', 0, N'p3478', N'p3478', N'a21600697', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (66, N'Plataforma DEISI - Gesto de TFCs (II)', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Continuar o trabalho j desenvolvido na plataforma de gesto de TFCs para incluir novas funcionalidades: upload dos relatrios e outros artefactos; agendamento das apresentaes intermdias e finais; registo das avaliaes intermdias e finais; notificaes; etc. A aplicao foi desenvolvida em Java usando a framework Spring. O objectivo  integrar as novas funcionalidades j no prximo semestre. Este trabalho  para ser desenvolvido por um aluno.', NULL, N'Atribuido', NULL, N'DEISI66', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (67, N'Route Planner', N'2018', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Consiste em criar uma plataforma onde pode-se colocar um ponto de origem e um destino e a plataforma calcula opes de locomoo para o trajeto indicado, podendo ter em conta restries e/ou preferncias dos utilizadores (ex: no quer andar de comboio). A ideia  que a plataforma comunique com uma base de dados (CRUD) por meio de web services para poder obter a informao necessria acerca dos meios de transporte disponveis. A ideia j foi discutida com o professor Bruno Cipriano que aceitou-a.', 10, N'Atribuido', 22, N'Aluno67', NULL, 0, N'p4453', N'p4453', N'a21800835', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (68, N'Gestor de devedores interno', N'2018', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Este protejo tem como objectivo agilizar/automatizar o processo de abate de dividas de cada consultor da empresa.  Com isto a empresa pretende ter uma webapp personalizada/costumizada ,feita de raiz seguindo os requisitos da empresa , onde todo o processo de gesto  controlado na mesma.  A recolha de dados da situao financeira  feita atravs do acesso a uma base dados. Para validar qualquer alterao nos valores em divida dever ser feito upload dos devidos comprovativos.', 30, N'Atribuido', NULL, N'Empresa68', NULL, 0, N'p5617', N'p5617', N'emp30', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (69, N'Spotter', N'2018', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Spotter  uma aplicao que visa gerir uma comunidade de utilizadores e locais de interesse no tursticos/conhecidos. Estes so locais com uma vista, paisagem ou locais relevantes que, fundamentalmente, tenham algum interesse e no representem diretamente negcios, monstrando assim locais alternativos a quem estejas disposto a visita-los normalmente pouco divulgados e apenas conhecidos apenas por locais, sendo assim locais mais "niche" e de pouco movimento.', 10, N'Recusado', 24, N'Aluno69', N'proposta com erro de forma: submetida por grupo mas s identifica 1 aluno; tema e descrio submetido anteriormente a titulo individual por outro aluno.
Prazo de proposta de aluno terminado, reformulao ter que ser submetida por orientador
', 0, N'p4453', N'p4453', N'a21502583', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (70, N'Utilizao de chaves criptogrficas em TEE (Trusted Execution Environment)', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Um mtodo predominante e comprovado para lidar com informaes confidenciais e reduzir os pontos de ataque nos dispositivos  o Trusted Execution Environment (TEE) que consiste em criar uma rea separada na unidade central de processamento. Este trabalho pretende explorar solues de cdigo aberto que permitem implementar o TEE, tais como o OP-TEE e GzOS e avaliar a capacidade em proteger particularmente chaves criptogrficas de serem copiadas. ', NULL, N'Atribuido', NULL, N'DEISI70', NULL, 0, N'p3025', NULL, N'p3025', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (71, N'Plataforma de aluguer de filmes', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Plataforma de registo de aluguer de filmes que usa Distributed Ledger technology para registo de transaces. ', NULL, N'Indisponivel', NULL, N'DEISI71', NULL, 0, N'p5404', NULL, N'p5404', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (72, N'Spotter', N'2018', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Spotter  uma aplicao que visa identificar e gerir e uma comunidade de utilizadores e locais de interesse no tursticos/pouco conhecidos. Mostrando assim locais alternativos a quem estejas disposto a visita-los normalmente pouco divulgados e apenas conhecidos apenas pelas pessoas locais.
Prope-se o desenvolvimento de uma base de dados remota, webservice respetivo e da App Android Spotter assim como a sua verso para iOS.', 10, N'Atribuido', 28, N'Aluno72', NULL, 0, N'p4453', N'p4453', N'a21502583', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (73, N'Simulao multi-agente comparativa da difuso de inovaes e noticias falsas.', N'2018', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O objetivo central deste trabalho  replicar um estudo anterior que utiliza um modelo multi-agente para identificar processos coletivos relevantes a propagao e assimilao de inovaes numa rede social. Apos a replicao do estudo, incluindo a implementao do respetivo sistema de simulao multi-agente os alunos vo adaptar o sistema para similar propagao de noticias falsas.', NULL, N'Atribuido', NULL, N'DEISI73', NULL, 0, N'p5265', NULL, N'p5265', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (75, N'Plataforma Gesto de Requisitos', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao de gesto de ciclo de vida de requisitos utilizando abordagens SCRUM e AGSI-Arquitectura da Gesto de Sistemas de Informao e descrio de requisitos em template a fornecer por orientador
Trabalho enquadra-se em projecto mais amplo, visando a integrao com ferramentas de gesto de projecto (e.g.: MS-Project) e de controlo de verses (e.g.: git) 
Disciplinas listadas no so de obrigatoriedade cumulativa; As tecnologias indicadas so alternativas', NULL, N'Publicado', NULL, N'DEISI75', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (76, N'Geoplacement (controlo de presena electrnico)', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Soluo de validao de presena e acesso a espaos controlados utilizando dispositivos de comunicao moveis pessoais. 
Composta por 3 elementos:
1. Marcador fsico colocado no local onde se controla presena e acesso (alternativa com emissor Beacon);
2. Aplicao mvel para ler o marcador/emissor e registar leitura em base de dados central, aps validar  geolocalizao.
3.Backoffice de controlo de registos e utilizadores 
Componente mvel em android', NULL, N'Publicado', NULL, N'DEISI76', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (77, N'Plataforma de subscrio de servios', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Construo de um ecossistema colaborativo em formato crowdsourcing, destinado a entidades da Economia Social, suportado por uma plataforma de subscrio de servios, disponibilizados em formato de partilha de tempo  e operados segundo um modelo de funcionamento sem vinculo permanente entre entidades e pessoas participantes.
O presente TFC tem por objecto definir o modelo conceptual para o Ecossistema e a construo de um PoC, em formato de prottipo funcional,  para validao do mesmo.', NULL, N'Publicado', NULL, N'DEISI77', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (79, N'PROPOSTA RETIRADA POR INDISPONIBILIDADE DE ORIENTACO', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolver interface de avaliao para SAD-RH, de acordo com critrios e mtricas de avaliao definidas pela DRH.
A interface integra com ERP de Gesto de RH para identificao de funcionrios e interaco com histrico de avaliaes, mas tem autonomia para validao de preenchimento
Construo da soluo implica desenvolvimento de API, em formato Web Service, para integrao com ERP
Autenticao OAuth com plataforma Google', 5, N'A Aguardar Atribuio', NULL, N'DEISI79', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (80, N'Carlos Relvas: Catlogo Estereoscpico', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O projecto de investigao Carlos Relvas Full 3D. The Stereo Catalogue (CICANT- ULHT) est a criar um catlogo
digital online para apresentar as fotografias estereoscpicas de Carlos Relvas.
', 31, N'Nao Atribuido', NULL, N'DEISI80', NULL, 0, N'p5404', NULL, N'p5404', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (82, N'Plataforma de Apoio a Projetos de Multiplos Clientes', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'A ideia deste trabalho  auxiliar os alunos no desenvolvimento de projetos que envolvam multiplos clientes e ou servidores. Nos dias de hoje, os alunos so obrigados a usar mquinas virtuais para o efeito, no entanto, nem sempre os alunos tm hardware para lanar multiplas instancias do virtualbox. Uma vez que o docker consome consideravalmente menos recursos, neste trabalho pretende-se criar uma plataforma que abstraia a criao de dockers de forma dinmica consoante as necessidades.', 10, N'Publicado', NULL, N'Aluno82', NULL, 0, N'p5502', N'p5502', N'a21705328', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (83, N'Plataforma DEISI - Gesto de TFCs (Desenvolvimento)', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Continuar o trabalho j desenvolvido na plataforma de gesto de TFCs para corrigir bugs entretanto detetados e incluir novas funcionalidades a serem discutidas no incio do projecto. A aplicao foi desenvolvida em Java usando a framework Spring. O objectivo  integrar as novas funcionalidades j no prximo semestre. Este trabalho  para ser desenvolvido por um grupo de 2 alunos.', NULL, N'Publicado', NULL, N'DEISI83', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (84, N'Plataforma DEISI - Gesto de TFCs (Anlise e Testes)', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Este projecto ser complementar ao TFC DEISI83 ("Plataforma DEISI - Gesto de TFCs (Desenvolvimento)") sendo mais vocacionado para a anlise de requisitos com o objectivo de criar uma bateria de testes exaustivos, usando JUnit e outras frameworks relevantes, assim como testes de usabilidade e desempenho. Este trabalho  para ser desenvolvido por um grupo de 2 alunos.', NULL, N'Publicado', NULL, N'DEISI84', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (85, N'PROPOSTA RETIRADA POR INDISPONIBILIDADE DE ORIENTACO', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A soluo a criar dever permitir a um utilizador no conhecedor da linguagem SQL criar relatrios a partir de um base de dados a que lhe seja dado acesso, podendo imprimi-los ou exporta-los para ficheiro externo O TFC continua trabalho anterior que j executa queries elementares com SGBD MS-SQL e MySQL, com exportao em formato MS-Excel e XML Nesta fase, pretende-se desenvolver interface grfico, aprofundar construo de queries, permitir impresso e acrescentar o SGBD PostgreSQL', NULL, N'A Aguardar Atribuio', NULL, N'DEISI85', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (86, N'fechadura inteligente', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de fechadura digital inteligente com abertura em 2 passos.
Projecto desenvolvido com Raspbery Pi (fechadura) e Android (chave)
Fechadura com ecr tctil gera QR lido pelo Android. O QR  enviado para o Raspberry que devolve PIN. o utilizador deve inserir o PIN no ecr da Fechadura
Hardware (Raspberry) disponibilizado', NULL, N'Publicado', NULL, N'DEISI86', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (87, N'Digital Badges in Education', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Atravs deste trabalho pretende-se desenvolver um sistema de badges digitais, em que o objetivo principal proposto para o projeto  construir uma plataforma onde  seja possvel  desenvolver, validar e reconhecer as competncias de cada aluno. Este sistema ser testado com vrias disciplinas das licenciaturas do DEISI.
Este TFC j se encontra em curso.
', 10, N'Publicado', NULL, N'Aluno87', NULL, 0, N'p4997', N'p4997', N'a21703957', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (88, N'Plugin DP para IntelliJ', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se criar um plugin para o IDE IntelliJ cujo objectivo principal  automatizar o processo de submisses para a plataforma Drop-Project. Para alm disso, sero estudadas/implementadas componentes de apoio ao ensino, tambm baseadas em interaces entre o IntelliJ e o DP, como por exemplo o calculo de estatsticas e o "download" automtico de projetos para a mquina do Professor. Este sistema ser testado durante este ano lectivo em LP2 e/ou AED.
O trabalho j se encontra em curso.', 10, N'Publicado', NULL, N'Aluno88', NULL, 0, N'p4453', N'p4453', N'a21705201', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (89, N'Aplicao mvel para acesso ao Open edX (cursos online)', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A Lusfona est a preparar-se para disponibilizar cursos online atravs da plataforma Open edX, mas esta plataforma no disponibiliza aplicaes nativas para Android e iOS. Pretende-se que os alunos desenvolvam estas aplicaes tendo em conta a documentao e cdigo disponibilizados pela plataforma. Este trabalho dever ser feito em grupos de 2 alunos, em que pelo menos um dos alunos dever ter um macbook (para poder desenvolver a app iOS). O trabalho ser co-orientado pelo Miguel Tavares.', NULL, N'Publicado', NULL, N'DEISI89', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (90, N'Content Marketplace platform', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma plataforma de gesto entre jornalistas, redatores e outros produtores de contedos (artigos, ebooks, casos de sucesso, datasheets, etc.) e empresas de TI que necessitam de garantir a disponibilizao de contedos sobre as suas temticas, produtos ou servios. Esta plataforma dever posteriormente ter funcionalidades como depois de um determinado contedo de redes sociais ser aprovado, disseminar diretamente em vrias redes sociais.', 11, N'Publicado', NULL, N'DEISI90', NULL, 0, N'p3113', NULL, N'p3113', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (91, N'Buddy abroad ', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'(continuao de prottipo de TFC 2018-19)
Fuso de Tinder +Uber para Guias Turisticos
Desenvolvimento de plataforma para a criao de novo modelo de guias tursticos. Conceitos: 
1- qualquer um pode ser guia turistico, tal como qualquer um pode conduzir um taxi para a Uber; 
2- fundamental fazer o match entre os desejos de visita de um turista com o perfil adequado de conhecimentos tursticos do guia, tal como o Tinder faz a juno de pessoas com os mesmos gostos', 12, N'Publicado', NULL, N'DEISI91', NULL, 0, N'p3113', NULL, N'p3113', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (92, N'Portal Empresarial de Contedos e CRM Integrado', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de Plataforma de Contedos para empresa em WordPress, com integrao de Mdulo de Gesto de Clientes OpenSource (a definir entre SuiteCRM e Odoo) e de Marketing (extenso e integrao com Mailchimp ou outro a definir).', 32, N'Publicado', NULL, N'DEISI92', NULL, 0, N'p3113', NULL, N'p3113', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (93, N'Plataforma de Gesto de Identidades e Acessos', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Criao de prottipo de plataforma de Gesto de Identidades e Acessos, baseado em Open Source, com anlise de vantagens e desvantagens entre OpenIAM, Shibboleth, WSO2 Identity Server, MidPoint, Soffid, Apache Syncope, Gluu.
Objetivo demonstrar integrao e controlo de acessos  com um CRM, um Active Directory, um Gestor de Contedos, etc.', NULL, N'Publicado', NULL, N'DEISI93', NULL, 0, N'p3113', NULL, N'p3113', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (94, N'Android Quiz Builder v2', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Introduo de elementos de jogo na aplicao Android Quiz Builder. Sero introduzidos novos tipos de questionrio, para suportar jogos do estilo "Quem quer ser milionrio?".
Este projecto ser a continuao de um TFC realizado em ano lectivo anterior.', 10, N'Publicado', NULL, N'Aluno94', NULL, 0, N'p4453', N'p4453', N'a21702482', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (95, N'Sistema de gesto de produtos com ligao ao InvoiceExpress', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Neste projecto pretende-se desenvolver uma plataforma (Web Application) para gerir produtos compostos (criar produtos novos a partir de produtos j existentes - matrias primas). A plataforma, desenvolvida usando a framework DJANGO, dever permitir a venda e aquisio de produtos. Para isso dever integrar a API de facturao do InvoiceExpress. A plataforma dever ter tambm uma base de dados de clientes e fornecedores e permitir listar todas as operaes de cada cliente e fornecedor. ', NULL, N'Publicado', NULL, N'DEISI95', NULL, 0, N'p5403', NULL, N'p5403', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (96, N'Expanso de uma plataforma de automatic assessment tool (AAT)', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Neste TFC pretende-se adicionar algumas funcionalidades a uma plataforma de "automatic assessment tool" desenvolvida em django. A plataforma corre conjuntos de testes sobre os trabalhos dos alunos e atribui uma classificao. De momento a plataforma apenas aceita submisses em grupo de trabalhos em linguagem de programao C. Pretende-se expandir a capacidade da plataforma para: aceitar submisses individuais; permitir outras linguagens de programao; correr testes unitrios.', NULL, N'Publicado', NULL, N'DEISI96', NULL, 0, N'p5403', NULL, N'p5403', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (97, N'Sistema de gesto de uma escola de actividades nauticas', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A Wakevilla LDA  uma escola de actividades nauticas que fornece tambm alojamento. Neste TFC pretende-se desenvolver um sistema para gesto de clientes, reservas, e registo de actividades. O desenvolvimento ser feito na framework django.', 33, N'Publicado', NULL, N'DEISI97', NULL, 0, N'p5403', NULL, N'p5403', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (98, N'Aprendizagem baseada em jogos', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se explorar a conceo e desenvolvimento de jogos (gamifcation) para a aprendizagem ao longo da vida, formao profissional ou em contexto das redes colaborativas. O tema, plataforma (web, mobile ou desktop), tecnologias e as funcionalidades dos jogos/ recursos devero ser definidos juntamente com o orientador.', 34, N'Publicado', NULL, N'DEISI98', NULL, 0, N'p3478', NULL, N'p3478', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (99, N'Redes de negcios de colaborao e marketing que motivam com incentivos e prmios', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Modelos de redes de negcios de colaborao e marketing, em redes ativas com incentivos e prmios. As plataformas (web, mobile ou desktop), tecnologias e as funcionalidades devero ser definidos juntamente com o orientador.', 35, N'Publicado', NULL, N'DEISI99', NULL, 0, N'p3478', NULL, N'p3478', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (100, N'Gesto de negcios internacionais', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Plataforma digital onde desenvolve-se um conjunto de ferramentas que permitam gerir projetos em diversos mercados internacionais, gerir projetos de empreendedores e divulgar o prprio projeto, junto de empresas, empreendedores e investidores, e outros stakeholders. Gesto de participantes em mercados e projetos, um BackOffice, com um conjunto de interfaces que permitam a inscrio de empresas, mas tambm a de potenciais empreendedores que pretendam recorrer aos servios.', 36, N'Publicado', NULL, N'DEISI100', NULL, 0, N'p3478', NULL, N'p3478', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (101, N'Framework para Rede Colaborativa de Organizaes', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'As redes no s ajudam os agentes a atingir massa crtica e econmica de escala, mas tambm a abranger mercados maiores e mais diversificados, o que no aconteceria se os mesmos agentes trabalhassem isolados. Aplicando e estendendo um framework para redes colaborativas de organizaes pretende-se criar redes fortes e motivar a inovao, assim,  proposto a articulao de uma rede de atores empresariais.', 37, N'Publicado', NULL, N'DEISI101', NULL, 0, N'p3478', NULL, N'p3478', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (102, N'Agregador multitemtico', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Portal social, com pesquisa natural, semntica, adaptativo a cada utilizador, agregador multitemtico de publicaes de blogs, portais e outros recursos. As plataformas (web, mobile ou desktop), tecnologias e as funcionalidades devero ser definidos juntamente com o orientador.', 38, N'Publicado', NULL, N'DEISI102', NULL, 0, N'p3478', NULL, N'p3478', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (103, N'Desenvolvimento de uma API REST (com web tokens)', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de uma API REST (com web tokens) de gesto de uma associao desportiva que visa guardar a assiduidade nos treinos de cada escola associada, pagamentos de cotas (e integrao com paypal), marcao de eventos especiais e broadcast de emails para os associados (todos, ou por categoria) com diversas informaes.', 10, N'Atribuido', NULL, N'Aluno103', NULL, 0, N'p5403', N'p5403', N'a21604600', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (104, N'Aplico para Gesto do Clube de Corrida e Caminhada', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao para gesto de actividades do Clube de Corrida e Caminhada de uma software house nacional. O projecto inclui o desenho da base de dados, assim como a implementao da funcionalidade de gesto de membros e actividades, e de alguns relatrios estatsticos (p.e. para controlo de oramentos).

O projecto j se encontra em andamento com o orientador Rodrigo Correia e o co-orientador Bruno Cipriano.', 10, N'Publicado', 32, N'G104', NULL, 0, N'p5653', N'p5653', N'a21703349', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (105, N'Gerao automtica de horrios', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se com este trabalho o desenvolvimento de uma aplicao web, em que funcionrios dos recursos humanos poderiam utilizar para introduzirem prioridades e informaes sobre qual a unidade curricular, nmero de horas, disponibilidades dos docentes, turmas, para que esta sozinha fizesse a atribuio de salas e gerar os horrios das turmas.
', NULL, N'Publicado', NULL, N'DEISI105', NULL, 0, N'p5932', NULL, N'p5932', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (106, N'Sistema de autenticao para a Bateria Sistmica de Lisboa', N'2019', N'Aceite Com Modificaes', NULL, N'2022-10-07', N'2022-10-07', N'A Bateria Sistmica de Lisboa (BSL) diz respeito a um conjunto de provas numa base serious games, utilizada para a reabilitao cognitiva de pessoas com leso cerebral adquirida. Estes pacientes tm habitualmente dfices cognitivos que podem ser revertidos com a utilizao de tarefas que replicam atividades da vida real, como aquelas que compem a BSL. No entanto, esta prova carece ainda de um sistema de autenticao online que permita uma gesto de utilizadores, que  o objetivo deste projeto.', 10, N'Publicado', NULL, N'NDEISI106', N'Orientador poder ser alterado no processo de atribuio de TFC', 0, N'p3025', N'p3025', N'pnd4', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (107, N'Base de dados de utilizadores da Bateria Sistmica de Lisboa', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'A Bateria Sistmica de Lisboa (BSL) diz respeito a um conjunto de provas numa base serious games (desenvolvido com Unity), utilizada para a reabilitao cognitiva de pessoas com leso cerebral. Estes pacientes tm dfices cognitivos que podem ser revertidos com a utilizao de tarefas que replicam atividades da vida real, como aquelas que compem a BSL. O objetivo deste projeto  migrar estas tarefas para um sistema que oferea um modo de interao mais intuitivo, como os tablets com Android.', 10, N'Publicado', NULL, N'NDEISI107', NULL, 0, N'p5502', N'p5502', N'pnd4', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (108, N'Criar um programa que faa a integrao entre o CRM Pipedrive e a ferramenta de facturao Invoicexpress', N'2019', N'Aceite Com Modificaes', NULL, N'2022-10-07', N'2022-10-07', N'O objectivo do trabalho  criar um programa que faa a integrao entre o CRM Pipedrive e a ferramenta de facturao Invoicexpress. Esta ferramenta vai consumir os dados s APIs pblicas da Pipedrive e permitir criar facturas na ferramenta de facturao, agilizando assim o trabalho de extrao de informao de uma plataforma para a outra. 
Pretende-se com este trabalho a integrao entre duas ferramentas,  autenticao e transporte de dados. 

Este TFC j est atribudo ao aluno N21705356.', 39, N'Publicado', NULL, N'Empresa108', N'Orientador poder ser alterado no processo de atribuio de TFC', 0, N'p3113', N'p3113', N'emp39', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (109, N'Sistema de autenticao da Bateria Sistmica de Lisboa', N'2019', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'A Bateria Sistmica de Lisboa (BSL) diz respeito a um conjunto de provas numa base serious games, utilizada para a reabilitao cognitiva de pessoas com leso cerebral adquirida. Estes pacientes tm habitualmente dfices cognitivos que podem ser revertidos com a utilizao de tarefas que replicam atividades da vida real, como aquelas que compem a BSL. No entanto, esta prova carece ainda de um sistema de autenticao online que permita uma gesto de utilizadores, que  o objetivo deste projeto.', NULL, N'Recusado', NULL, N'NDEISI109', N'duplicado NDEISI106', 0, NULL, NULL, N'pnd4', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (110, N'Bateria Sistmica de Lisboa: Adaptao para tablet', N'2019', N'Aceite Com Modificaes', NULL, N'2022-10-07', N'2022-10-07', N'A Bateria Sistmica de Lisboa (BSL) diz respeito a um conjunto de provas numa base serious games desenvolvidas em Unity e utilizadas para a reabilitao cognitiva de pessoas com leso cerebral adquirida. Uma das limitaes apontadas diz respeito ao modo de interao que  baseado nos perifricos de um PC que levantam dificuldades a estes utilizadores. Uma possibilidade  migrao destas provas para um suporte mais intuitivo como os tablets, sendo este o objetivo deste projeto.', 10, N'Indisponivel', NULL, N'NDEISI110', N'Orientador poder ser alterado no processo de atribuio de TFC', 0, N'p5963', N'p5963', N'pnd4', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (111, N'Anlise automtica de conversas em redes sociais.', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O objetivo desta tese e coletar dados de conversas em redes sociais, particularmente do Twitter e de situaes experimentais controladas, para utilizar tcnicas de inteligncia artificial e ''machine learning'' para identificar conceitos chave. Uma vez identificados estes conceitos chave vamos analizar as suas dinmica complexas no tempo para tentar identificar vulnerabilidades sociais, ideias que tem alta ressonncia e capacidade viral, etc. ', NULL, N'Publicado', NULL, N'DEISI111', NULL, 0, N'p5265', NULL, N'p5265', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (112, N'Plataforma de resumos - De estudantes para estudantes ', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Neste TFC ir ser desenvolvido um site e uma aplicao mvel de demonstrao de resumos de qualidade para o estudo e promover o estudo independente e dirio fora das horas de aula.
O site ir permitir os alunos e professores observarem os resumos que so publicados. A funo do professor  de moderador, enquanto a funo dos alunos  publicar, votar e comentar sobre os resumos.
A app serve de suporte ao site e tem como objectivo permitir aos alunos estudarem em condies que no permite um PC.', 10, N'Publicado', 35, N'G112', NULL, 0, N'p5932', N'p5932', N'a21703806', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (113, N'Robot-Parte 1: Estrutura e Movimento', N'2019', N'Aceite Com Modificaes', NULL, N'2022-10-07', N'2022-10-07', N'O rob deve ter por 100 a 120 cm, base estvel (baixo centro de massa) e ser capaz de se movimentar pelo cho, em todas as direes, com o uso de rodas.  As rodas devem ter dimetro que permitam ultrapassar pequenos obstculo no cho (p.e.: caricas) sem afetar a estabilidade do conjunto. Sobre essa base-rob ser colocado o "corpo" humanide do rob com outras partes de hardware (p.e.: cmera, microfone, colunas, etc.).  	Ser necessrio criar uma API para que um computador remoto possa interagir/controlar o rob. 	Ex.: https://wowwee.com/products/robots', 40, N'Publicado', NULL, N'Empresa113', N'Orientador poder ser alterado no processo de atribuio de TFC', 0, N'p2703', N'p2703', N'emp40', 0, NULL)
GO
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (114, N'Robot-Parte 2: Interaco e Comunicao', N'2019', N'Aceite Com Modificaes', NULL, N'2022-10-07', N'2022-10-07', N'O rob deve ter por 100 a 120 cm, base estvel (baixo centro de massa) e ser capaz de se movimentar pelo cho, em todas as direes, com o uso de rodas. As rodas devem ter dimetro que permitam ultrapassar pequenos obstculo no cho (p.e.: caricas) sem afetar a estabilidade do conjunto. Sobre essa base-rob ser colocado o "corpo" humanide do rob com outras partes de hardware (p.e.: cmera, microfone, colunas, etc.). Ser necessrio criar uma API para que um computador remoto possa interagir/controlar o rob. Ex.: https://wowwee.com/products/robots', 40, N'Publicado', NULL, N'Empresa114', N'Orientador poder ser alterado no processo de atribuio de TFC', 0, N'p1059', N'p2703', N'emp40', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (115, N'Criao de portal de colaborador em Odoo', N'2019', N'Aceite Com Modificaes', NULL, N'2022-10-07', N'2022-10-07', N'Implementao de portal de interao com os colaboradores, baseado na tecnologia Odoo. Dever abarcar os seguintes processos: Frias, Faltas, Folhas de Horas, Recibos vencimento, Pedidos e suporte, Avaliao, Comunicaes, Gamificao', 41, N'Publicado', NULL, N'Empresa115', N'Orientador poder ser alterado no processo de atribuio de TFC', 0, N'p5930', N'p5930', N'emp41', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (116, N'Prognsticos de  Apostas Desportivas ', N'2019', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'A nossa aplicao tem como objetivo ajudar apostadores no mercado de apostas desportivas atravs de dicas de outros apostadores, funcionando ainda como uma comunidade de apostadores em que cada apostador possa dar a sua previso para o jogo X, explicando (ou no) em seguida porque tomou essa escolha, atravs de um forum. Para alem da app estamos a pensar em criar um site.', 10, N'Recusado', 39, N'G116', N'No tem contedo suficiente para TFC de durao anual', 0, N'p5932', N'p5932', N'a21701870', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (117, N'Desenvolvimento de vrias aplicaes solicitadas pelas reas de negcio', N'2019', N'Aceite Com Modificaes', NULL, N'2022-10-07', N'2022-10-07', N'Foram identificadas algumas necessidades de desenvolvimento e algumas aplicaes de suporte ao negcio. O objetivo deste trabalho seria o de detalhar os requisitos das aplicaes junto das reas de negcio e o desenvolvimento das mesma em Outsystems.', 42, N'Publicado', NULL, N'Empresa117', N'Orientador poder ser alterado no processo de atribuio de TFC', 0, N'p2', N'p2', N'emp42', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (118, N'Prognsticos de  Apostas Desportivas ', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Esta app/site funciona como uma comunidade de apostadores em que cada
apostador possa dar a sua previso para o jogo X, explicando (ou no)
em seguida porque tomou essa escolha, atravs de um forum, tendo outras funcionalides como:
Comparao de odds dos diferentes sites de apostas e incluir um sistema de clculo de odds. Dando uma ajuda ao utilizadores para escolher o melhor site para apostar.
Estatsticas das equipas.
Perfil de utilizador.
Sistema de ranking.
', 10, N'Publicado', 44, N'G118', NULL, 0, N'p5290', N'p5290', N'a21701870', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (119, N'Aplicao para Gesto e Planeamento Tcnicos no Terreno', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se criar uma aplicao Web, que suporta um modelo de subscries, para controlar, gerir e planear tcnicos no terreno. Esta plataforma incluir um backoffice, no qual podemos gerir todo o planeamento. Cada tcnico ligado  subscrio vai poder instalar no seu dispositivo mvel a app para poder executar o servio no terreno. Todas as funcionalidades do backoffice como das apps, ser entregue ao docente.  ', 10, N'Publicado', 46, N'G119', NULL, 0, N'p5403', N'p5403', N'a21705846', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (120, N'Matchmaking de Oferta e Procura de servios', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'O objetivo  a criao de uma plataforma onde uma entidade que queira contratar um servio far um perfil com as suas referencias e, no caso de existir um utilizador individual com a totalidade ou a maioria dos requisitos do contratante, os dois so imediatamente colocados em contacto. O mesmo acontece para algum que procura trabalho. (Ex: Uma escola de surf  procura de um instrutor no ms de Julho na Nazar). Este sistema facilitar e automatizar o processo de procura e oferta.', 10, N'Publicado', 47, N'G120', NULL, 0, N'p5932', N'p5932', N'a21703906', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (121, N'Optimizao de atribuio de equipas para maximizar a capacidade de resposta', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'App com gesto de pedidos de limpezas e respectiva atribuio das equipas necessrias. O utilizador envia fotos do local ou divisria que precisa de uma servio de limpeza, posteriormente o sistema analisa todas as informaes dadas pelo utilizador includo fotos. Atravs de inteligncia artificial o sistema avalia quantas pessoas so necessrias para limpar a diviso num curto espao de tempo e atribui automaticamente uma das equipas para o pedido. Assim no  necessaria interveno humana.', 10, N'Publicado', 49, N'G121', NULL, 0, N'p2703', N'p2703', N'a21703974', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (122, N'Aplicao de gesto de condomnio usando Python e Django', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A linguagem Python  um sucesso de popularidade. A plataforma Django permite desenvolver em Python para a Web.
Pretende-se desenvolver um site de gesto de condomnios usando esta tecnologia, interagindo com uma base da dados MySQL.
As especificaes do site sero fornecidas pela professor, pelo que o(s) aluno(s) tero que se concentrar no estudo da linguagem e na utilizao da plataforma para o desenvolvimento Web.', NULL, N'Publicado', NULL, N'DEISI122', NULL, 0, N'p2357', NULL, N'p2357', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (123, N'Aplicao de gesto de condomnio usando PHP', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A linguagem PHP permite disponibilizar sites hospedados na nuvem de forma barata.
Pretendemos desenvolver uma aplicao WEB usando linguagem PHP e base dados MySQL, sem recorrer a frameworks para garantir controlo total do cdigo.
As especificaes do site sero fornecidas pela professor, assim como os templates de cdigo, que depois sero usados para implementar todas as funcionalidades.', NULL, N'Publicado', NULL, N'DEISI123', NULL, 0, N'p2357', NULL, N'p2357', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (124, N'Aplicao WEB para gesto de inventrio de assets informticos', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao WEB que permita inventariar "assets" usados num departamento de informtica. Por "assets" entendemos computadores, routers, switchs, redes, salas tcnicas, etc, etc.
Os "assets" tm relaes hierrquicas entre si, que variam de cliente para cliente, pelo que o grande desafio est no modelo de dados e na interface grfica.
A soluo tcnica poder assentar em Java, PHP ou Python', NULL, N'Publicado', NULL, N'DEISI124', NULL, 0, N'p2357', NULL, N'p2357', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (125, N'Aplicao de Gesto Portfolio Aplicacional', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O objetivo deste trabalho  continuar o desenvolvimento de uma aplicao de Gesto de Portflio Aplicacional, complementando a oferta comercial existente, que permita fazer o registo e controlo das aplicaes em utilizao, em implementao e planeadas, definir mtricas para classificar as mesmas.
Dever ser permitido tipificar os perfis de utilizadores e definir as aplicaes que cada perfil necessita.
Devero ser disponibilizados alertas e relatrios agregados pelas mtricas implementadas.', NULL, N'Publicado', NULL, N'DEISI125', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (126, N'Aplicao de Gesto de Arquitetura Empresarial, Projetos e Portflio Aplicacional.', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se com este trabalho desenvolver uma aplicao que permita controlar e relacionar as aes resultantes de um projeto de arquitetura empresarial, dos projetos em curso e do portflio aplicacional.', NULL, N'A Aguardar Atribuio', NULL, N'DEISI126', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (127, N'Elaborao da Arquitetura Empresarial (Sistemas de Informao) para uma empresa baseada no Framework de Zachman', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se com este trabalho efetuar um projeto de arquitetura empresarial de uma empresa utilizando como referncia a Framework de Zachman e utilizando uma ferramenta de modelao de processos, preferencialmente o Powerdesigner 16.0 ou posterior. Devero ser identificadas reas de melhoria e aes a desenvolver (Plano de ao).               ', 43, N'A Aguardar Atribuio', NULL, N'DEISI127', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (128, N'Desenvolvimento de funcionalidades para o middleware UbiPri', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Recentemente, a Internet of Things (IoT) tem verificado um crescimento muito rpido, com cada vez mais dispositivos do quotidiano ligados  Internet. Desta forma, torna-se importante estudar novos mtodos de proteger os dados e privacidade dos utilizadores, tendo em conta que dispositivos IoT tm limitaes a nvel do poder computacional e de consumo energtico, pelo que pode tornar difcil a implementao de solues robustas que garantam a privacidade dos dados dos utilizadores.
', NULL, N'A Aguardar Aprovao', NULL, N'DEISI128', NULL, 0, N'p5905', NULL, N'p5905', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (129, N'Monitorizacao de dados ambientais', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Utilizao de IOT para monitorizao de dados ambientais(Temperatura e humidade).
1. Utilizao de Hardware e software open-source.
2.  Aplicao mvel para apresentar a informao.
3. Base de dados para controlo de registos e armazenamentos dos dados da monitorizao .', 10, N'Publicado', NULL, N'Aluno129', NULL, 0, N'p3025', N'p3025', N'a21502753', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (130, N'LogiSim melhorado - Verso Lusfona', N'2019', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Neste TFC, o objetivo  usar o LogiSim como partida para desenvolver um simulador feito  medida dos contedos programticos de SD e AC dos cursos da ECATI.
Os trabalhos a efetuar so:Dominio da gerao do simulador a partir do cdigo fonte existente;Introduo de caractersticas inovadoras/reparao de bugs existentes:Desenvolvimento de bibliotecas especficas para SD e AC;
Os requisitos para este TFC so:
a) Domnio da programao JAVA + Grficos.
b) Mdia das notas de SD e AC mn de 14V.', NULL, N'A Aguardar Atribuio', NULL, N'DEISI130', NULL, 0, N'p1059', NULL, N'p1059', 0, NULL)
