INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (132, N'Machine Learning para deteo de fraude online de cartes bancrios', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Este trabalho tem como objetivo auxiliar a deteo de fraudes bancrias, de forma a reduzir o prejuzo de empresas que possam ser afetadas. Para isso, explora-se e aplica-se o conceito de Machine Learning, para se conseguir fazer uma deteo em tempo real de uma possvel fraude, durante uma transao online', NULL, N'Publicado', NULL, N'DEISI132', NULL, 0, N'p5963', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (133, N'REST API Associao Portuguesa de Hapkido Yang Hum Kwan', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Este Trabalho Final de Curso (TFC) enquadra-se num requerimento de umaassociao sem fins lucrativos de Artes Marciais, a Associao Portuguesa de HapkidoYang Hum Kwan, que pretende uma plataforma de gesto geral, como horrios e eventos,pagamentos de quotas e matria lecionada em cada uma das escolas das variadas Artes', 44, N'Publicado', NULL, N'DEISI133', NULL, 0, N'p5403', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (134, N'Sistema de Avaliao de Desempenho', N'2019', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Este projeto ser utilizado para a vertente dos Recursos Humanos, de uma instituio, onde se ir integrar o Sistema de Avaliao de Desempenhos de forma a que cada utilizador presente no sistema ERP-GHR consiga ser avaliado e autoavaliado.A aplicao a ser desenvolvida ser uma extenso do sistema ERP de Recursos Humanos j existente, sendo esta um motor de inquritos personalizado', NULL, N'Publicado', NULL, N'DEISI134', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (135, N'App4SHM - Aplicao mvel para anlise estrutural', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao mvel que consiga medir a integridade de uma estrutura (ex: ponte) atravs de leituras do acelermetro e posterior processamento desses dados recorrendo a algoritmos de machine learning. Os algoritmos podero ser executados no prprio dispositivo ou num servidor com o qual o dispositivo comunica. Este trabalho est inserido num projecto de investigao do Departamento de Engenharia Civil.
Nota: Este TFC j est atribudo.', 45, N'Publicado', NULL, N'DEISI135', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (136, N'Vacqa Mobile - Auxlio ao diagnstico de medicina veterinria', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A aplicao vacqa  uma aplicao muito popular de assessoria  explorao de bovinos desenvolvida por um professor do departamento de medicina veterinria. Pretende-se desenvolver a mesma aplicao em ambiente mvel que permita aos veterinrios fazerem o seu diagnstico diretamente no telemvel ou tablet, atravs do preenchimento de dados e captura de fotos.
Este trabalho  desenvolvido em parceria com o Departamento de Medicina Veterinria.', 46, N'Publicado', NULL, N'DEISI136', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (137, N'Plataforma de inquritos aos alunos', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Os inquritos de satisfao aos alunos do DEISI tm sido um sucesso mas dependem de um servio externo (responster) com reduzida flexibilidade e interoperabilidade. Pretende-se desenvolver uma soluo alternativa que mantenha todas as garantias de anonimato e a qualidade da interface grfica em dispositivos mveis mas que permita maior interoperabilidade com os sistemas existentes. Caso tenha sucesso, passar a ser a plataforma oficial para os referidos inquritos.
Nota: TFC j atribudo.', NULL, N'Publicado', NULL, N'DEISI137', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (138, N'Gesto de centros de investigao', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao web com a responsabilidade de gerir toda a informao dos investigadores de um centro de investigao: equipa de investigadores, atividades desenvolvidas, publicaes, etc. A aplicao dever ser capaz de produzir diversos relatrios com base nesta informao. Este desenvolvimento ser integrado num projecto do 
CeiED (Centro de Estudos Interdisciplinares em Educao e Desenvolvimento), mas pretende-se que seja alargado a outros centros no futuro.', 47, N'Publicado', NULL, N'DEISI138', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (139, N'Home Surveilance Kit baseado em Raspberry Pi', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver um sistema domstico de videovigilncia utilizando Raspberry Pi e os seu componentes
O sistema ser composto por 3 componente: microcmeras, armazenamento local e site para visualizao de imagens. O sistema dever permitir live feed e consulta de gravaes
Em adio, o sistema dever implementar soluo avanadas, ex.: deteco de movimento, reconhecimento de objectos ou outros
Hardware disponibilizado', NULL, N'Publicado', NULL, N'DEISI139', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (140, N'fechadura inteligente', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de fechadura digital inteligente com segurana avanada e confirmao em 2 passos. 
Projecto desenvolvido em Raspbery Pi (fechadura) e Android (chave) 
Pode assumir vrios formato, a concretizar na primeira faze do TFC, que podero ir desde uso de credenciais integradas com sistemas empresarias  gerao dinmica de PIN (fechadura gera QR lido pelo Android, que gera PIN a inserir pelo utilizador na fechadura)
Continua TFC de anos anteriores
Hardware disponibilizado', NULL, N'Publicado', NULL, N'DEISI140', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (141, N'Plataforma de subscrio de servios', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Construo de um ecossistema colaborativo em formato crowdsourcing, destinado a entidades da Economia Social, suportado por uma plataforma de subscrio de servios, disponibilizados em formato de partilha de tempo e operados segundo um modelo de funcionamento sem vinculo permanente entre entidades e pessoas participantes. 
Para este ano lectivo o objectivo  desenvolver a plataforma de publicao e subscrio de servios, segundo as especificaes do modelo conceptual produzido em TFC anterior', NULL, N'Publicado', NULL, N'DEISI141', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (142, N'Plataforma de gesto de eventos v2', N'2020', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se dar seguimento ao desenvolvimento da componente web da plataforma de gesto de eventos desenvolvida por alunos do ano lectivo anterior. Sero adicionadas funcionalidades como, por exemplo, a edio de dados (membros, eventos), a migrao automtica da base de dados antiga para a nova plataforma. Tentativamente ser analisada a possibilidade de implementar um sistema de recomendao de eventos.

A orientao deste projecto j foi discutida com o Prof. Bruno Cipriano.', 10, N'Publicado', NULL, N'Aluno142', NULL, 0, N'p4453', N'p4453', N'a21807154', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (143, N'Aplicao de anlise e priorizao de requisitos', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Numa empresa so perdidas muitas horas no processo de deciso de quais os requisitos a implementar.  fundamental otimizar recursos e ganhos.
O objectivo deste trabalho  desenvolver uma aplicao que normaliza e avalie a qualidade dos requisitos, face a normas gerais de anlise e especificao de requisitos e internas de uma empresa e que os classifique e lhes atribua prioridades, para facilitar o processo de deciso.
Deve tambm ser feita uma anlise da situao atual da oferta de mercado.
', NULL, N'Publicado', NULL, N'DEISI143', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (144, N'Aplicao de anlise de qualidade de software.', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Muitas aplicaes especficas desenvolvidas, nunca chegam a ser utilizadas e  quando existe necessidade de fazer alterao das mesmas, quem fez o desenvolvimento j no se encontra na empresa.
Pretende-se com este trabalho desenvolver uma aplicao que permita, com base nos requisitos e em normas realizar a anlise e qualidade do software, como parte integrante do processo de aceitao e entrada em produo do mesmo.
Deve tambm ser feita uma anlise da situao atual da oferta de mercado.', NULL, N'Publicado', NULL, N'DEISI144', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (145, N'Aplicao de gerao de testes a software', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Para que uma aplicao cumpra os objectivos para os quais foi implementada  fundamental assegurar que ela satisfaz as necessidades e requisitos definidos.
Por outro lado cada vez que se verificam actualizaes ou adio de requisitos,  fundamental garantir que para alm das novas funcionalidades, tambm as anteriores continuam a funcionar.
Pretende-se com base em Use Cases desenvolver uma aplicao que gere (e opcionalmente execute) testes de aceitao e conformidade da aplicao.', NULL, N'Publicado', NULL, N'DEISI145', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (146, N'Aplicao mvel para membros de plataforma de gesto de eventos', N'2020', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao mvel para membros da plataforma de gesto de eventos de uma software house nacional.

Este projecto j se encontra em desenvolvimento com o Prof. Rodrigo Correia como orientador e o Prof.  Bruno Cipriano como co-orientador.  ', 10, N'Publicado', NULL, N'Aluno146', NULL, 0, N'p5653', N'p5653', N'a21805632', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (149, N'Traveller''s community', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Objetivo do TFC consiste no desenvolvimento de uma aplicao mobile cujo alvo so as pessoas que gostam de viajar e necessitam de uma ajuda a conhecer novos locais, rotas de viagens interessantes, conhecer novas pessoas durante a viagem, novos costumes locais, etc.
', NULL, N'Publicado', NULL, N'DEISI149', NULL, 0, N'p5932', NULL, N'p5932', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (152, N'Plataforma MentHA: gamification do treino cognitivo e avaliao neuropsicolgica', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolver uma plataforma web de gamification que implemente o programa de estimulao cognitiva Mental Health and Aging (shorturl.at/dCUW1), atravs de jogos, tarefas e quizz multimdia que incidam sobre a funcionalidade cognitiva e social dirigido a pessoas que apresentam comprometimento neuropsicolgico e/ou demncia. Ser tambm implementado um protocolo de avaliao neuropsicolgica dos pacientes, permitindo gerir, aplicar e visualizar avaliaes destes. lucio.studer@ulusofona.pt', 60, N'Publicado', NULL, N'DEISI152', NULL, 0, N'p6069', NULL, N'p6069', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (154, N'Aplicao para a monitorizao e controlo de Drones', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao mvel que consiga monitorizar drones em qualquer ponto geogrfico e ao mesmo tempo ser possvel control-los. Este trabalho insere-se em parceria com uma empresa portuguesa.', NULL, N'Publicado', NULL, N'DEISI154', NULL, 0, N'p6115', NULL, N'p6115', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (155, N'Aplicao para a monitorizao de misses para Drones', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao mvel que consiga criar/editar/enviar/receber misses para drones em qualquer ponto geogrfico e ao mesmo tempo ser possvel monitoriz-los. Este trabalho insere-se em parceria com uma empresa portuguesa.', NULL, N'Publicado', NULL, N'DEISI155', NULL, 0, N'p6115', NULL, N'p6115', 0, NULL)
