INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (184, N'Telemvel como instrumento musical em orquestra de computadores em rede', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de uma aplicao mvel que transforme o telemvel num instrumento musical.
No backoffice existir uma base de dados de sons e funes de transformao. No telemvel, um interface permitir escolher sons e transformaes que sero parametrizadas pelos sensores do telemvel. A srie temporal de sinais dos sensores ser enviada para o backoffice que gerar os sons transformados, sendo reproduzidos e integrados numa orquestra de computadores em rede. lucio.studer@ulusofona.pt', 61, N'Publicado', NULL, N'DEISI184', NULL, 0, N'p6069', NULL, N'p6069', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (185, N'Plataforma para gesto de agrupamento musical', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de uma aplicao web para apresentao e gesto da atividade de agrupamentos musicais. Dever congregar informao variada do agrupamento, e permitir criar e gerir eventos, inserindo texto, fotos, videos, localizao. Dever usar uma mailing list e interagir com o Facebook e Instagram para publicitar automaticamente os eventos, antes e depois. Dever apresentar dashboards da sua atividade (mapa, salas de concerto, nmero de concertos, page views). lucio.studer@ulusofona.pt', 57, N'Publicado', NULL, N'DEISI185', NULL, 0, N'p6069', NULL, N'p6069', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (186, N'Aplicao de comparao de preos', N'2020', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'A nossa aplicao destina-se a comparar preos de produtos de vrios supermercados e postos de combustvel.
O objetivo da aplicao  consoante um produto ou produtos escolhidos pelo utilizador, esta indicar ao utilizador qual o supermercado ou posto de combustvel na proximidade que oferece os melhores preos.
', 10, N'Recusado', 56, N'G186', N'Existe proposta anterior sobre o mesmo tema', 0, N'p5617', N'p5617', N'a21702996', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (187, N'Plataforma de comparao de jogadores de futebol (website)', N'2020', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Esta plataforma serve para clubes de futebol ou analistas compararem jogadores de futebol atravs dos seus atributos (velocidade, finalizao, etc). Esta plataforma indicar tambm qual o jogador mais indicado para substituir outro, qual o jogador que encaixa melhor no modo de jogo de X equipa. Entre vrias estatsticas do jogador.

', 10, N'Recusado', 56, N'Aluno187', N'1. A proposta no foi discutida com o orientador proposto
2. No tem fundamentao suficiente para justificar a taxa de esforo esperada de TFC', 0, N'p5932', N'p5932', N'a21702996', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (188, N'Footbet', N'2020', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'A nossa proposta de TFC consiste no desenvolvimento de uma aplicao mobile tendo em vista o suporte na compra e venda de prognsticos de apostas desportivas. A nossa aplicao contar com vrias estatsticas  que permitam aos utilizadores escolherem entre os melhores vendedores de prognsticos disponveis.', 10, N'Recusado', 56, N'Aluno188', N'1. A proposta no foi discutida com o orientador proposto
2. No tem fundamentao suficiente para justificar a taxa de esforo esperada de TFC', 0, N'p5932', N'p5932', N'a21702996', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (189, N'Plugin Drop-Project v2', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Est a ser desenvolvimento um plugin para interaco com o DP a partir do IntelliJ. Neste momento o plugin j permite fazer as submisses a partir do IDE. Pretende-se melhorar este projecto, atravs de:
- testes com utilizador (em aula) para identificar pontos de melhoria (da GUI e no s);
- acrescentar funcionalidades para Professor (p.e. um Professor pode querer ir buscar uma submisso feita por um aluno para o seu prprio computador);
Ser dada preferncia a trabalhos individuais.', NULL, N'Publicado', NULL, N'DEISI189', NULL, 0, N'p4453', NULL, N'p4453', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (191, N'DEISI ASK', N'2020', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se criar uma plataforma de esclarecimentos de duvidas entre os alunos. Em semelhana com o piazza (https://piazza.com/class) queremos criar foruns e subforuns de dvidas dadas pelos alunos, que possam ser respondidas tanto por alunos como docentes. Iremos criar um sistema de votao para que seja mostrada a resposta que mais alunos achem correta. Outra das funcionalidades passa por criar pequenas salas de video+voz para esclarecimento/aulas de grupo.', 10, N'Publicado', 58, N'G191', NULL, 0, N'p5932', N'p5932', N'a21901521', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (192, N'Rede colaborativa inter-organizacional', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'As redes no s ajudam os agentes a atingir massa crtica e econmica de escala, mas tambm a abranger mercados maiores e mais diversificados, o que no aconteceria se os mesmos agentes trabalhassem isolados. Pretende-se criar redes fortes e motivar a inovao, assim, prope-se a articulao de uma rede de atores.', NULL, N'A Aguardar Atribuio', NULL, N'DEISI192', NULL, 0, N'p3478', NULL, N'p3478', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (193, N'Plataforma para jogos didticos destinados a crianas', N'2020', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma plataforma para criao e execuo de jogos didticos destinados a crianas (p.e. identificao de objetos,cores,palavras,etc.).
Este projecto j se encontra com o Prof. Bruno Cipriano como orientador.', 10, N'Recusado', NULL, N'Aluno193', N'Aluno no cumpriu ECTS minimos para inscrio em TFC', 0, N'p4453', N'p4453', N'a22006194', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (194, N'MyProfHelper', N'2020', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma plataforma web auxiliar na avaliao dos alunos. Dever ser possvel marcar as presenas dos alunos, constituir grupos, criar avaliaes de grupo ou individuais. Finalmente, a plataforma dever permitir exportar as pautas em vrios formatos como xls, csv ou pdf.

Este trabalho ser orientado pelo Professor Miguel Tavares', 10, N'Publicado', NULL, N'Aluno194', NULL, 0, N'p5502', N'p5502', N'a21700052', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (195, N'App Mobile para Registo de Notas de Campo', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Esta aplicao mvel ter como objetivo auxiliar no registo de notas de campo que agora so efetuadas em papel. A aplicao enviar estes registos para um servidor que ir reter todos estes dados. A aplicao deve tambm funcionar em modo offline para a eventualidade de no se conseguir ligar ao servidor.', 46, N'Publicado', NULL, N'DEISI195', NULL, 0, N'p5502', NULL, N'p5502', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (196, N'Machine Learning e a interoperabilidade com RPA (Robotic Process Automation)', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Os estudantes devero desenvolver algortmicos da aprendizagem automtica, assim como tcnicas de resoluo dos desafios apresentados por cada conjunto de dados, adequados para cada problema e aplicar os algoritmos a novos conjuntos de dados. Este sistema dever operar em conjunto com sistemas de Robotic Process Automation (RPA) fornecendo dados para a tomada de deciso. Apresentao de um POC elaborado com recurso a um sistema de ML em conjunto com um RPA (UiPath; Blueprism; etc. / open source)', 62, N'A Aguardar Atribuio', NULL, N'DEISI196', NULL, 0, N'p901798', NULL, N'p901798', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (197, N'Chat / Voice e a interoperabilidade com Robotic Process Automation (RPA) ', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Os estudantes devero desenvolver um sistema de chatbot que recorra a NLP/IA, recorrendo a uma framework  sua escolha. Este sistema dever operar em conjunto com sistemas de Robotic Process Automation (RPA) fornecendo dados com os quais estes iro interagir. Apresentao de um POC elaborado com recurso a um Chatbot a trabalhar em conjunto com um RPA (UiPath; Blueprism; etc. / open source)', 62, N'A Aguardar Atribuio', NULL, N'DEISI197', NULL, 0, N'p901798', NULL, N'p901798', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (198, N'Pandora - Yet Another Automated Assessment Tool', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O Pandora  uma ferramenta de avaliao automtica desenhada para correr testes de input/output sobre cdigo C. Pretende-se com este trabalho expandir as funcionalidades desta plataforma. Algumas das novas funcionalidades so:  
Gerao automtica de testes input/output
Gerao e avaliao de testes unitrios
Melhorar o interface de administrao;
', NULL, N'Publicado', NULL, N'DEISI198', NULL, 0, N'p5403', NULL, N'p5403', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (199, N'Android Walk Test App', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de um aplicativo Android que permita colectar medies da rede mvel celular (drive tests). As medies so armazenadas temporariamente no dispositivo mvel e enviadas para a plataforma Metric ( https://metric.pt/ ), SaaS para planeamento de redes mveis da Multivision. Existe um Minimum Viable Product ( shorturl.at/euHLP ) que ser expandido com novas funcionalidades tais como visionamento de informao georeferenciada num mapa que aumente a conscincia do utilizador na rede.', 63, N'Publicado', NULL, N'DEISI199', NULL, 0, N'p6069', NULL, N'p6069', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (200, N'Plataforma de Gestao da Federao de Andebol', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de plataforma de gesto de equipas, jogos, campeonatos, torneios, etc. da Federao Portuguesa de Andebol. Pretende-se estruturar um novo modelo tecnolgico e automatizado de toda a atividade desportiva.', 64, N'Publicado', NULL, N'DEISI200', NULL, 0, N'p3113', NULL, N'p3113', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (202, N'Robot de reconhecimento de espaos', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver um robot que consiga mapear o espeo envolvente, identificando obstculos 
O material ser disponibilizado pelo orientador.
Trabalho j atribudo', NULL, N'Publicado', NULL, N'DEISI202', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (203, N'Data Science em Gastronomia Computacional', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Gastronomia Computacional  um campo cientfico emergente que alia as Cincias Informticas e o Big-Data.
A importncia da Gastronomia Computacional  diversa: desde a sua utilizao em impressoras 3D na impresso de alimentos, ao turismo e  inspirao do processo criativo de um Chef.
Este projeto tem como objetivo que o aluno colabore com investigadores do Copelabs e ISMAT no desenvolvimento cientfico e informtico de uma plataforma Web direcionada para a Gastronomia Portuguesa e Turismo.', 65, N'Publicado', NULL, N'DEISI203', NULL, 0, N'p4492', NULL, N'p4492', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (204, N'InstaScraper', N'2020', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Hoje em dia qualquer negcio usa o Instagram para marketing. Sendo uma das maiores redes sociais do mundo com cerca de 1 bilio de utilizadores dirios, tornando difcil um empreendedor destacar o seu produto/empresa. O bom uso de hashtags  fundamental para isso acontecer. InstaScraper usa um web scraper para extrair e analisar quais os melhores hashtags usados pela concorrncia, seleccionando e compilando as melhores opes para uma maior visibilidade de cada publicao na plataforma.', 10, N'Recusado', 66, N'G204', N'Proposta no validada com orientador', 0, N'p5403', N'p5403', N'a21904353', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (205, N'Assistente de Prognsticos Desportivos', N'2020', N'Aceite Com Modificaes', NULL, N'2022-10-07', N'2022-10-07', N'Este aplicativo de apoio aos "Punters" semi-profissionais, pretende responder a uma maior procura de ferramentas do gnero no mercado.
A ideia  automatizar um processo, que consiste num conjunto de modelos preditivos(poisson) que em conjunto com estratgias de gesto de banca e "follow up" no estado do mercado indica qual os prognosticos + lucrativos e avisa-nos.
O mercado das apostas desportivas  + simples que os financeiros normais sendo possvel ter retornos > 10% p/ ms. ', 10, N'Publicado', NULL, N'Aluno205', N'A descrio do tema  pouco claro quanto a funcionalidades e tecnologias a utilizar. Deve ser feito um trabalho de detalhe neste mbito j para a primeira entrega demonstrando que o esforo do TFC  adequado', 0, N'p3478', N'p3478', N'a21906962', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (206, N'Plataforma de Pontuao para Ginstica Artstica ', N'2020', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Plataforma para integrar nas competies de ginstica Artstica permitindo ter um registo dos participantes, juizes, local da prova e entre outras informaes que fossem relevantes, com funcionalidade dos juizes terem a capacidade de registar os resultados dos atletas nos diferentes aparelhos em tempo real. A plataforma teria tambm um modo de apresentao de resultados. Adicionalmente os atletas tambm poderiam consultar resultados.', 10, N'Publicado', NULL, N'Aluno206', NULL, 0, N'p2357', N'p2357', N'a21805677', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (207, N'Gesto de Portflio de Projetos e Releases', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Numa empresa existem inmeras iniciativas de projetos de IT e pedidos de novos requisitos  sempre complexo o processo de controlar, recomendar e decidir quais sero implementados. Os recursos humanos e financeiros so sempre limitados, sendo o papel de um PMO cada vez mais importante.
O objetivo deste trabalho tem como foco as atividades de Gesto e Planeamento de Projetos e de Construo, Controle e Execuo de Releases da empresa a realizar pelo PMO e realizao de prottipo.', NULL, N'Publicado', NULL, N'DEISI207', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (208, N'Chatbot inteligente para implementar sistema de recomendaes ', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O objetivo de este TFC  apoiar ao aluno/a na sua formao na rea de chatbots, especificamente chatbots que usam algum mecanismo inteligente recomendar aces a tomar num contexto dado. Neste projeto usamos dados recolhidos no mbito de conversas entre jovens online. O chatbot ir recomendar a tomadores de deciso que intervenes educativas podero reforar boas prticas nas interaes online. Os dados a serem utilizados so dados simulados para testes gerados a partir de dados reais.', NULL, N'Publicado', NULL, N'DEISI208', NULL, 0, N'p5265', NULL, N'p5265', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (209, N'Implementao de Integrao de Dados da Federao de Andebol', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento de plataforma de integrao de dados e gesto de ficheiros. Pretende-se estruturar um novo modelo tecnolgico e automatizado de toda a atividade desportiva.', 66, N'Publicado', NULL, N'DEISI209', NULL, 0, N'p3113', NULL, N'p3113', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (210, N'Integrao de avaliao na Aplicao MentHA', N'2020', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Integrar a avaliao na aplicao MentHA. Dever  integrar as perguntas e cotaes das vrias partes do protocolo. Dever ser implementada a cotao automtica de respostas de escolha mltipla assim como o regiso manual nas restantes. O modelo de dados devera espelhar a estruturao do Protocolo em Parte  area de avaliao  teste  dimenso  pergunta. Um relatrio dever apresentar as cotaes de forma grfica, recorrendo a dashboards.', 60, N'publicado', NULL, N'DEISI210', NULL, 0, N'p6069', NULL, N'p6069', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (211, N'Plataforma de Monitorizao de Impressoras 3D de Construo de Casas', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Plataforma de gesto e monitorizao de IoT de Impressoras 3D de construo de casas, usando sensores e arduinos. Projeto no mbito de parceria com empresa Youcoders, no mbito do Seed Funding da Universdade Lusfona', 55, N'Publicado', NULL, N'DEISI211', NULL, 0, N'p3113', NULL, N'p3113', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (212, N'Buddy abroad - Front End', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Fuso de Tinder +Uber para Guias Turisticos
Desenvolvimento de interface app mobile e Web de Gesto de plataforma para a criao de novo modelo de guias tursticos. Conceitos: 
1- qualquer um pode ser guia turistico, tal como qualquer um pode conduzir um taxi para a Uber; 
2- fundamental fazer o match entre os desejos de visita de um turista com o perfil adequado de conhecimentos tursticos do guia, tal como o Tinder faz a juno de pessoas com os mesmos gostos', 53, N'Publicado', NULL, N'DEISI212', NULL, 0, N'p5932', NULL, N'p3113', 0, NULL)
