1- Um turista pode escolher roteiros de viagens
2- Um condutor de tuk tuk define roteiros, recebe pagamentos
3- Plataforma retm fee de comisso
4- Plataforma Web de gesto de turistas e condutores
', 53, N'Publicado', NULL, N'DEISI214', NULL, 0, N'p3113', NULL, N'p3113', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (215, N'Content Marketplace platform', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Lanamento de Prototipo desenvolvido em TFCs de anos anteriores (2019 - anlise de requisitos; 2020 - prototipagem) de plataforma de gesto entre jornalistas, redatores e outros produtores de contedos (artigos, casos de sucesso, datasheets, etc.) e empresas de TI que necessitam de garantir a disponibilizao de contedos sobre as suas temticas, produtos ou servios. Funcionalidades futuras: disseminar contedo de redes sociais ser aprovado, disseminar diretamente em vrias redes sociais.', 67, N'Publicado', NULL, N'DEISI215', NULL, 0, N'p3113', NULL, N'p3113', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (216, N'Acompanhamento nutricional em farmcias', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Em colaborao com o Departamento de Cincias Farmacuticas, pretende-se desenvolver uma aplicao web para registo e monitorizao de dados clnicos associados a utentes farmacuticos que estejam a seguir um programa nutricional. O trabalho inclui uma fase inicial de levantamento de requisitos com base em focus groups envolvendo farmacuticos, nutricionistas e pacientes. O objetivo  produzir uma aplicao piloto que ser utilizada por 2 ou 3 farmcias.
Nota: Este TFC j est atribudo', 68, N'Publicado', NULL, N'DEISI216', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (217, N'Site DEISI', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Anlise e reformulao do site institucional do DEISI. Anlise de usabilidade e SEO. Anlise de CMS que suportem o site. Reformulao da arquitetura de navegao. Incluso de pginas dinmicas construdas a partir de uma BD. Ligao a APIs externas (ex: Linkedin, Github).', NULL, N'Publicado', NULL, N'DEISI217', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (218, N'Gesto de centros de investigao', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Continuao do desenvolvimento de uma uma aplicao web com a responsabilidade de gerir toda a informao dos investigadores de um centro de investigao: equipa de investigadores, atividades desenvolvidas, publicaes, etc. Este desenvolvimento est integrado num projecto do CeiED (Centro de Estudos Interdisciplinares em Educao e Desenvolvimento), mas pretende-se que seja alargado a outros centros no futuro.', 69, N'Publicado', NULL, N'DEISI218', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (219, N'App4SHM 2.0', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se evoluir uma aplicao Android nativa (Kotlin) que mede a integridade de uma estrutura (ex: ponte) atravs de leituras do acelermetro e processa esses dados atravs de algoritmos de machine learning. Novas funcionalidades: verso em iOS, sincronizao de vrios dispositivos; utilizao de docker; melhorias diversas. Este trabalho est inserido num projecto de investigao do Departamento de Engenharia Civil.
Um dos alunos deve possuir um Mac (para desenvolvimento iOS)', 70, N'Publicado', NULL, N'DEISI219', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (220, N'Virtual Check-In', N'2021', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Criar um website onde seja possvel registar e obter informaes sobre alojamento. Normalmente sem rececionista. 
Com essa informao ser gerado um vdeo e enviado ao hspede, com as indicaes de como chegar e entrar, no alojamento, sem necessidade de presena fsica.
Pretende-se obter os dados das reservas dos sites normalmente conhecidos e utilizados, para personalizar os vdeos.
E um guia turstico para os hspedes a quando da entrada no alojamento. ', 10, N'Publicado', NULL, N'Aluno220', NULL, 0, N'p2703', N'p2703', N'a20065449', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (221, N'Acompanhamento de processos judiciais', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se desenvolver uma aplicao web para recolha de informao relativa a processos judiciais e posterior obteno de indicadores estatsticos relevantes para identificao de situaes anmalas. Este projeto ser desenvolvido em conjunto com a Faculdade de Direito e est inserido num projeto de investigao do programa"Fazer +".', 71, N'Publicado', NULL, N'DEISI221', NULL, 0, N'p4997', NULL, N'p4997', 0, NULL)
