INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (223, N'Aplicao para gesto de uma AUGI e situao atual na Regio da Grande Lisboa', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'H muitos anos atrs, muitos terrenos foram objeto de operaes fsicas de parcelamento destinadas  construo e vendidos lotes a particulares, sem existncia de infraestruturas e processos de licenciamento. Foram criadas pelas Cmaras Municipais vrias AUGI (reas Urbanas de Gnese Ilegal). Pretende-se com o presente trabalho fazer o ponto de situao nas vrias Cmaras Municipais da rea da Grande Lisboa e desenvolver uma aplicao para fazer a Gesto da atividade de uma AUGI.', 73, N'Publicado', NULL, N'DEISI223', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (224, N'Aplicao de gerao de testes a software', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Para que uma aplicao cumpra os objetivos para os quais foi implementada  fundamental assegurar que ela satisfaz as necessidades e requisitos definidos. Quando se verificam atualizaes ou adio de requisitos,  fundamental garantir que para alm das novas funcionalidades, tambm as anteriores continuam a funcionar, fazendo testes de regresso.
Pretende-se com base em Use Cases desenvolver uma aplicao que gere (e opcionalmente execute) testes de aceitao e conformidade da aplicao.', NULL, N'Publicado', NULL, N'DEISI224', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (225, N'PMO, Gesto de Portflio de Projetos e Releases', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Numa empresa existem inmeras iniciativas de projetos de IT e pedidos de novos requisitos.  sempre complexo o processo de controlar, recomendar e decidir quais sero implementados. Os recursos humanos e financeiros so sempre limitados, sendo o papel de um PMO cada vez mais importante.
O objetivo deste trabalho tem como foco as atividades de Gesto e Planeamento de Projetos e de Construo, Controle e Execuo de Releases da empresa a realizar pelo PMO e realizao de prottipo.', NULL, N'Publicado', NULL, N'DEISI225', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (226, N'Plataforma de gesto de requisitos', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolver plataforma online para avaliao de requisitos e gesto do seu ciclo de vida seguindo modelo de AGSI (Arquitectura da Gesto de Sistemas de Informao)
As tecnologias listadas so indicativas, baseadas em desenvolvimentos anteriores, podem ser alteradas em funo de avaliao de situao a realizar na 1 fase do TFC', NULL, N'Publicado', NULL, N'DEISI226', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (227, N'Plataforma de subscrio de servios', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Construo de um ecossistema colaborativo em formato crowdsourcing, destinado a entidades da Economia Social, suportado por uma plataforma de subscrio de servios, disponibilizados em formato de partilha de tempo e operados segundo um modelo de funcionamento sem vinculo permanente entre entidades e pessoas participantes. Para este ano lectivo o objectivo  desenvolver a plataforma de publicao e subscrio de servios, segundo as especificaes do modelo conceptual produzido em TFC anterior', NULL, N'Publicado', NULL, N'DEISI227', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (228, N'Drop-Project para Android', N'2021', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'O Drop-Project (DP)  uma ferramenta muito utilizada no curso para a realizao de exerccios e projetos. Acontece que, o DP econtra-se apenas funcional para projectos Java / Kotlin que depois so mavenized (convertidos para maven). Uma vez que o Android usa o Gradle, torna-o incompatvel para este tipo de projetos. O objetivo deste trabalho  fazer com que o DP seja tambm compativel com o Android, uma vez que seria muito til para a cadeira de Computao Mvel.

Orientador: Miguel Tavares', 10, N'Publicado', NULL, N'Aluno228', NULL, 0, N'p5502', N'p5502', N'a21905661', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (229, N'Combater o desperdcio alimentar e ''controlar'' a despensa', N'2021', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se criar uma aplicao mvel para combater o desperdcio alimentar. O objetivo  saber as datas de validade dos produtos que adquire e que tem na despensa, podendo receber notificaes sobre a aproximao do fim da validade destes na altura em que desejar (um dia/uma semana/um ms antes) - sujeito a configurao pelo utilizador. Os artigos sero introduzidos e catalogados na app atravs do respetivo cdigo de barras, de uma foto ou ainda manualmente. ', 10, N'Recusado', 76, N'G229', N'O trabalho no foi discutido com o orientador proposto, que no tem disponibilidade para orientao
Podem submeter novamente o mesmo tema, mas com novo orientador, do qual devem obter aprovao prvia', 0, N'p5617', N'p5617', N'a20076288', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (230, N'Drop-Project para Android -App', N'2021', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Este projeto tem como objetivo desenvolver uma aplicao Android que ajude nas avaliaes dos projetos da disciplina de computao mvel. Permitir listar todos os assignments de um projeto Android no DP, compilar esses projetos, instalar as aplicaes diretamente, entre outros aspetos.

Este trabalho j tem orientador: Miguel Tavares', 10, N'Publicado', NULL, N'Aluno230', NULL, 0, N'p5502', N'p5502', N'a21600035', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (231, N'Plugin Drop Project - v3 (projecto individual)', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Existe 1 plugin que permite a alunos e professores interagirem com o DP a partir do IntelliJ. O plugin tem funcionalidades em falta (ex: falta autenticao em alguns web services) que impedem o seu uso em produo. Objectivos: 1) implementar as funcionalidades em falta; 2) colocar em produo (p.e. uso em mini-testes); 3) corrigir bugs que sejam encontrados em produo. A funcionalidade (item 1) deve estar pronta no final do 1 semestre, para poder ser usado em produo no 2 semestre.', NULL, N'Publicado', NULL, N'DEISI231', NULL, 0, N'p4453', NULL, N'p4453', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (232, N'Plataforma de gesto de eventos - v3 (projecto individual)', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se dar continuidade ao desenvolvimento de uma plataforma Web de gesto de eventos, que permite a pessoas com o papel de administradores a criao de eventos nos quais outras pessoas , se podem inscrever, mediante um pagamento baseado num plafond. Existem vrias funcionalidades em falta que se pretendem implementar (p.e. renovao anual do plafond, integrao com LDAP). Para alm disso, pretende-se converter o sistema de Mongo para uma base de dados relacional e colocar em produo.', NULL, N'Publicado', NULL, N'DEISI232', NULL, 0, N'p4453', NULL, N'p4453', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (233, N'Aplicao Web para transformao digital do protocolo MentHA', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolver uma aplicao Web para a transformao digital do protocolo MENTHA (Mental Health and Aging) de avaliao neuropsicolgica de pessoas mais velhas com dfice cognitivo ou demncia leve. O protocolo  constitudo por um conjunto de testes, devendo a aplicao permitir registar avaliadores e pacientes, gerir e aplicar testes, criar relatorios e fazer anlise comparativa de dados. Preferncia a grupos com disponibilidade para trabalhar presencialmente 1-2 dias por semana no COPELABS.', 74, N'Publicado', NULL, N'DEISI233', NULL, 0, N'p6069', NULL, N'p6069', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (234, N'Aplicao Web para transformao digital do programa de estimulao cognitiva MenthaCOG', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolver uma aplicao Web que faa a transformao digital do programa de estimulao cognitiva MenthaCOG (Mental Health and Aging) dirigido a pessoas mais velhas com dfice cognitivo ou demncia leve. A aplicao ser constituda por jogos, tarefas e quizzes multimdia que incidam sobre a funcionalidade cognitiva e social. Preferncia a grupos com disponibilidade para trabalhar presencialmente 1-2 dias por semana no COPELABS.', 74, N'Publicado', NULL, N'DEISI234', NULL, 0, N'p6069', NULL, N'p6069', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (235, N'Aplicao Web MenthaCare', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolver uma aplicao Web  que faa a transformao digital do programa MenthaCare, dirigido a cuidadores de pessoas mais velhas com dfices conitivos e doena mental previa. Com o objetivo de dinamizar grupos psicoeducativos de ajuda mutua, dever permitir criar e gerir a atividade de grupos, permitindo o registo de moderadores e cuidadores, criar eventos, forums, quizzes assim como gerir contedos. Dada preferncia a disponibilidade para trabalhar 1-2 dias por semana no COPELABS', 74, N'Publicado', NULL, N'DEISI235', NULL, 0, N'p6069', NULL, N'p6069', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (236, N'Aplicao Web para estimao de cobertura celular de drones por sistemas de comunicaes mveis 4G e 5G. ', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Aplicao Web que estime o sinal recebido de uma estao base 4G/5G num drone em voo, considerando as caractersticas da antena, morfologia do terreno e dados vectoriais de edifcios, sendo o cenrio representado em 3D. Devero ser aplicados modelos de propagao adequados por forma a estimar a intensidade de sinal recebido em qualquer ponto 3D em redor da antena. Preferncia a grupos com disponibilidade para trabalhar presencialmente 1-2 dias/semana no COPELABS. Coorientador: Daniel Fernandes.', 75, N'Publicado', NULL, N'DEISI236', NULL, 0, N'p6069', NULL, N'p6069', 0, NULL)
