INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (255, N'Combater o desperdcio alimentar e ''controlar'' a despensa', N'2021', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se criar uma aplicao mvel para combater o desperdcio alimentar. O objetivo  saber as datas de validade dos produtos que adquire e que tem na despensa, podendo receber notificaes sobre a aproximao do fim da validade destes na altura em que desejar (um dia/uma semana/um ms antes) - sujeito a configurao pelo utilizador. Os artigos sero introduzidos e catalogados na app atravs do respetivo cdigo de barras, de uma foto ou ainda manualmente. ', 10, N'Publicado', 86, N'G255', NULL, 0, N'p5617', N'p5617', N'a20076288', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (256, N'Tickets  e anlise estatstica - Front End e Back End', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Aplicao de gesto empresarial com suporte para resoluo de tickets  e anlise estatstica dos mesmos . O projeto ser dividido em componente de back e front end.', NULL, N'Publicado', NULL, N'DEISI256', NULL, 0, N'p6115', NULL, N'p6115', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (257, N'Design inclusivo (e acessvel) em canais de vendas online ', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O objetivo deste TFC  o estudante aplicar os conhecimentos adquiridos nas UCs de Interao Humano Mquina e Aplicaes para a Web aos canais de venda online (Web e Mobile) de uma empresa. Como? Investigando e avaliando o nvel de conformidade com as normas da WCAG, propondo um novo desenho e/ou alteraes  programao por forma a tornar os canais mais acessveis a pessoas com incapacidades, sejam elas permanentes ou temporrias. O projeto ser realizado em parceria com uma empresa.', 81, N'Publicado', NULL, N'DEISI257', NULL, 0, N'p2211', NULL, N'p2211', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (258, N'Modelamento multi-agente de interaes em grupos sociais.', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O objetivo de este TFC  desevolver um modelo baseado em agentes para estudar como as normas sociais influenciam comportamentos intra-grupo e inter-grupo atravs de simulaes. Durante o TFC o aluno estudar a literatura clssica de sistemas multi-agente no contexto de redes sociais, e ir usar dados reais obtidos em escolas Portuguesas para a construo e validao do seu modelo. Este TFC de cariz cientfico est orientado  possibilidade de publicar os resultados.', NULL, N'Publicado', NULL, N'DEISI258', NULL, 0, N'p5265', NULL, N'p5265', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (259, N'Aplicao mobile para requisio de livros de uma biblioteca escolar', N'2021', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Pretende-se criar uma aplicao android que iria permitir a eficincia na requisio de livros de uma biblioteca escolar, com o intuito em apoiar e fortalecer o projeto pedaggico das escolas. O objetivo  ajudar alunos e professores a encontrem livros sem complicaes, em que s precisam inserir o ttulo do livro ou o autor para acessar uma lista de livros relevantes para sua consulta de pesquisa, bem como fazer registros de emprstimos de livros e ser alertado sobre o fim para a devoluo.', 82, N'Publicado', NULL, N'Aluno259', NULL, 0, N'p5653', N'p5653', N'a21505293', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (260, N'Desenvolvimento de aplicao WEB em PHP usando o gerador de cdigo PhpMyEDIT', N'2021', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desde o inicio do sculo que h geradores de cdigo baseados em tabelas. Este tipo de software aponta para uma tabela e faz a gerao de todo o cdigo CRUD a partir dos campos da tabela. O PhpMyEdit  um gerador deste tipo, j com alguns anos no mercado, open source e free, que serve de base a vrios produtos comerciais. Com este trabalho propomos que o alune estude o cdigo do PhpMyEdit e desenvolva uma aplicao WEB simples usando a gerao de cdigo.', NULL, N'Publicado', NULL, N'DEISI260', NULL, 0, N'p2357', NULL, N'p2357', 0, NULL)
