INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (268, N'Classificador baseado em algoritmos de machine learning para deteo de shots em transies de video', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A deteo de shots constitui-se como uma tarefa fundamental para o processo de sumarizao e produo de vdeos. A utilizao de mecanismos baseados em inteligncia artificial constitui-se como uma alternativa de especial destaque alinhada com a evoluo tecnolgica que temos observado ao longo dos ltimos anos. O objectivo  estimular o estudo e consequente aplicao de algoritmos de inteligncia artificial para o desempenho deste tipo de tarefa de forma automtica. ', NULL, N'Publicado', NULL, N'DEISI268', NULL, 2, N'p5782', NULL, N'p5782', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (269, N'Plataforma para monitorizao da temperatura e posio corporal com deteco/alarme de quedas', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Diversas aplicaes tm surgido no mbito da internet das coisas e a sade tem adquirido um particular destaque neste mbito. Neste projecto pretende-se implementar uma plataforma de visualizao sem fios para monitorizao da temperatura e posio corporal, com deteco de quedas.  Os alunos so encorajados a utilizar uma linguagem de programao com a qual se sintam confortveis e toda a componente de aquisio ser realizada com recurso a sensores e de um arduino. C/orientao Joo Carvalho', NULL, N'Publicado', NULL, N'DEISI269', NULL, 0, N'p5782', NULL, N'p5782', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (270, N'Sistema para Monitorizao de Plantas', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Diversas aplicaes tm surgido no mbito da internet das coisas e no que toca  componente de monitorizao do mundo que nos rodeia tal no  excepo. Neste projecto pretende-se implementar um prottipo de um n para monitorizao e controlo de plantas usando uma rede bluetooth.  Os alunos so encorajados a utilizar uma linguagem de programao com a qual se sintam confortveis e toda a componente de aquisio ser realizada com recurso a sensores e de um arduino. Orientao c/Joo Carvalho', NULL, N'Publicado', NULL, N'DEISI270', NULL, 0, N'p5782', NULL, N'p5782', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (271, N'Aplicao mvel para registo de revises de carros', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Por vezes as pessoas quando levam o carro ao mecnico esquecem-se de quando  que trocaram determinada pea do carro. Esta aplicao mvel tem como objetivo permitir o registo em cloud (atravs do Firebase) de revises dos carros. Esta aplicao ser desenvolvida com recurso  (muito provavelmente) tecnologia mais evoluida do mercado, o Flutter. O Flutter permite fazer desenvolvimento mvel para iOS, Android, Web e at Desktop. 

Este projeto ser desenvolvido por um aluno, no por um grupo.', NULL, N'Publicado', NULL, N'DEISI271', NULL, 0, N'p5502', NULL, N'p5502', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (272, N'Soluo de registo de momentos de avaliao', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Alguns alunos tm dificuldades em organizarem-se face aos vrios momentos de avaliao ao longo do semestre. Esta soluo passa pelo desenvolvimento de uma soluo que permitir o registo dos momentos de avaliao atravs de um backoffice, que consequentemente podero ser consultados atravs de uma aplicao mvel.
Esta aplicao ser desenvolvida com recurso  tecnologia mais evoluida do mercado, o Flutter. O Flutter permite fazer desenvolvimento mvel para iOS, Android, Web e at Desktop. ', NULL, N'Publicado', NULL, N'DEISI272', NULL, 0, N'p5502', NULL, N'p5502', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (273, N'Loteamentos ilegais, construes clandestinas, AUGI''s na rea da Grande Lisboa, ', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'H muitos anos foram feitos muitos loteamentos ilegais (muitos terrenos foram objeto de operaes fsicas de parcelamento ilegal para construo sem infraestruturas). Foram criadas pelas Cmaras Municipais vrias AUGI (reas Urbanas de Gnese Ilegal). Pretende-se com o presente trabalho fazer o levantamento exaustivo no terreno na rea da Grande Lisboa nas vrias Cmaras Municipais e criar um site para apresentao do trabalho feito, divulgao do tema e recolha de informao. Pode ser em grupo.', NULL, N'Publicado', NULL, N'DEISI273', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (274, N'Aplicao para a Gesto de uma Junta de Freguesia', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'As Juntas de Freguesia desempenham um papel de relevo e de proximidade com os seus residentes. Face s inmeras solicitaes que recebem tm dificuldades em responder a todas as solicitaes recebidas.
Pretende desenvolver-se um site onde os residentes possam aceder a informao da Junta, fazer pedidos, comunicar situaes e ocorrncias facilitando e permitindo a otimizao de recursos', NULL, N'Publicado', NULL, N'DEISI274', NULL, 0, N'p2', NULL, N'p2', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (275, N'Gesto de inventrio com base de dados dinmica', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Este TFC tem dois objectivos:
- Comparar modelos relacional com abordagem NoSQL para o uso com modelos de dados dinmicos (no estruturados)
- Desenvolver soluo de inventrio como aplicao dos resultados do estudo comparativo
A trabalho dever estudar vrias abordagens de dados utilizando ferramentas comuns de mercado (MySQL/MariaDB; MongoDB; Redis) para explorar formas distintas de trabalhar dados em ambiente empresarial', NULL, N'Publicado', NULL, N'DEISI275', NULL, 1, N'p2703', NULL, N'p2703', 0, NULL)
