A soluo a desenvolver dever permitir autenticao de ferramentas de terceiros', 83, N'Anulado', NULL, N'DEISI276', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (277, N'Gesto de distribuio alimentar', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Desenvolvimento e soluo Web para suporte a instituies que efectuam distribuio alimentar no mbito de apoio  comunidade
A soluo dever fazer gesto de existncias, aplicar regras de distribuio e manter histricos. Existe componente importante de proteco de dados pessoais
