Linguagem de desenvolvimento e SGBD a definir ', 83, N'Publicado', NULL, N'DEISI277', NULL, 0, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (278, N'ULHT Control Panel', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Aplicao web com o objetivo de facilitar a atribuio de horrios e marcaes de salas, fazendo com que os horrios deixem de ser feitos de uma maneira pouco prtica e complexa e no fundo se comece a realizar estas tarefas numa nica plataforma que atualiza as informaes automaticamente online.', NULL, N'Publicado', NULL, N'DEISI278', NULL, 0, N'p6115', NULL, N'p6115', 0, NULL)
