INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (280, N'Aplicao mvel para gesto de Personal Trainers', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A aplicao a ser desenvolvida destina-se  gesto de clientes de um personal trainer, com possibilidade visualizao e edio de horrios, notificaes para os clientes, acompanhamento online, especificao de treinos, criao de eventos, pagamentos, feed de noticias, entre outras.

A aplicao tem como cliente final um personal trainer certificado que ir supervisionar e validar as funcionalidades a serem desenvolvidas.', 84, N'Publicado', NULL, N'DEISI280', NULL, 0, N'p5932', NULL, N'p5932', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (281, N'Aplicao blockchain para rea de sade', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A Blockchain proposta inicialmente permite que os dados fiquem publicamente visveis para todos na rede blockchain. Desta forma,  possvel garantir a confidencialidade dos dados. Portanto,  necessrio desenvolver uma arquitetura composta por seis componentes que so: usurio, Dapp, MetaMask, Blockchain, IPFS e criptografia. O objetivo do trabalho  definir as ferramentas que sero utilizadas na implementao, bem como detalhar como foram realizadas as comunicaes entre estes componentes. ', NULL, N'Anulado', NULL, N'DEISI281', NULL, 0, N'p5905', NULL, N'p5905', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (282, N'Identificao de Variveis Abordando o Contexto de Notcias Falsas em Pases de Lngua Portuguesa (Fake News)', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Fake news  uma expresso muito utilizada atualmente, identificar vriaveis para definir se uma informao  falsa ou no  um dos problemas generalizados sobre esta temtica. Aps a identificao, definir um modelo e prottipo de aplicao para inicialmente pases de lingua portuguesa. Utilizao de informao, dados e algoritmos so necessrios para definio de critrios, parmetros e definies com base na idade, localizao ou tipo de aplicao utilizada, so itens considerados.', NULL, N'Publicado', NULL, N'DEISI282', NULL, 1, N'p5906', NULL, N'p5905', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (283, N'Gerir  perfis de utilizadores com base em privacidade de dados para aplicativos IoT', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'IoT pode ser vista de diversas perspectivas, dentre as quais, destacam-se as abordagens orientadas  Internet das coisas e ao conhecimento. Quanto  forma, basicamente, IoT pode ser dividida em suporte a humanos e suporte a aplicaes comerciais e industriais. Portanto, se faz necessrio desenvolver aplicaes capazes de gerir dados de utilizadores e dispositivos de acordo com regras e definies de privacidade de dados. Regras de perfil de acordo com ambiente, dispositivo ou variadas.  ', NULL, N'Anulado', NULL, N'DEISI283', NULL, 0, N'p5905', NULL, N'p5905', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (284, N'Comparao, uso e aplicao de algoritmos criptogrficos em cloud computing', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'A computao em nuvem (Cloud Computing) est cada vez mais presente no cotidiano das pessoas, como na medicina, em redes eltricas inteligentes (Smart Grids). Com isto surge a necessidade de proteger os dados processados pelo dispositivos IoT contra e invasores. Um bom modo de resolver este problema  atravs de algoritmos criptogrficos e otimizados.  Implementar, testar e comparar com objetivo de melhorias de segurana e desenpenho so necessrios para viabilizar solues em Cloud Computing. ', NULL, N'Anulado', NULL, N'DEISI284', NULL, 0, N'p5905', NULL, N'p5905', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (286, N'Plataforma Lusofona Arduino', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Explorar o ambiente de progr/ do Arduino e adapta-lo para o ensino de disciplinas na faculdade e utilizacao em projetos TFC:
- Documentar o ambiente de desenvolvimento do Arduino
- Desenvolver varias templates de apoio aos projetos:
  1 - Input/Output - Botoes com ADC e encoder
  2 - Esquema de menus simples em LCD 2x16
  3 - Esquema de menus/submenus em LCD bitmap, com grafismos simples
  4 - Comunicacao/perifericos - UART, PWM, ADC e TIMERS
  5 - Aplicao de demonstracao: Motor Gira', NULL, N'Publicado', NULL, N'DEISI286', NULL, 1, N'p1059', NULL, N'p1059', 0, NULL)
