Pretendemos que a plataforma nos diga a disponibilidade das mquinas (se esto a ser utilizadas ou no.), queremos fazer uma rea onde trabalhadores podem logar as suas entradas e sadas, gerir as peas que entram para a engomadoria, estatsticas de quantas peas cada funcionrio passa por dia.', 98, N'Recusado', 108, N'G322', N'Tema substituido', 0, N'p5617', N'p5617', N'a22004314', 0, NULL)
