INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (328, N'Gesto de propostas e oramentos', N'2022', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Este TFC tem como objetivo automatizar e facilitar a criao de propostas/oramentos, estas tero de estar guardadas para futuras edies.
O layout destas propostas/oramentos ter de ser facilmente manipulvel por parte do utilizador.
Esta  ferramenta ser tambm modular para facilmente se adaptar a qualquer tipo de negcio e para facilitar a sua manuteno. 
Manipulao de bases de dados ser algo essencial para fazer a gesto das propostas, clientes e materiais/equipamentos.', 99, N'Recusado', 113, N'G328', N'Alunos j tm outro tema atribudo', 0, N'p2703', N'p2703', N'a22007560', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (329, N'Therapist Screen', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'The Therapist Screen is a component for a therapy application in VR using the Unity game engine. It will allow the creation of user profiles and saving player metrics and settings on these profiles. Alongside this system, the student will develop an interface that is to be displayed in the moderating therapists screen, where they will be able to access player metrics and edit game settings - with these values being saved to the player profile currently in session.', 102, N'A Aguardar Atribuio', NULL, N'DEISI329', NULL, 0, N'p5441', NULL, N'p5441', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (330, N'Aplicao de Machine Learning para apoio  deciso na gesto hospitalar', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O Centro de Medicina de Reabilitao de Alcoito, referncia de Excelncia internacional, lida com questes generalizadas quanto  gesto de recursos. A anlise de dados  crucial para apoiar na deciso e optimizao destes.
O aluno, neste projecto, deve tratar e avaliar os dados de forma a desenvolver um modelo que prev a procura dos servios de internamento e/ou ambulatrio. Com os resultados, pretende-se melhorar a resposta do atendimento ao utente. Co-orientao da Prof. Maria Silva.
', 100, N'Publicado', NULL, N'DEISI330', NULL, 0, N'p6949', NULL, N'p6949', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (331, N'Aplicao mvel para tele-reabilitao de pacientes com dificuldades motoras/neurolgicas', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Em estreita colaborao com o Centro de Medicina de Reabilitao de Alcoito (Santa Casa da Misericrdia de Lisboa), pretende-se desenvolver uma aplicao mvel que permita a pacientes com dificuldades motoras e/ou neurolgicas realizar exerccios de reabilitao em casa, com acompanhamento remoto do corpo clnico. Inclui recolha de informao da evoluo do paciente que ser guardada numa Base de Dados para posterior anlise estatstica. Este trabalho ser co-orientado pelo Prof. Pedro Alves.
', 100, N'Publicado', NULL, N'DEISI331', NULL, 3, N'p6476', NULL, N'p6476', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (332, N'Sensores de Temperatura para HACCP', N'2022', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Tem como objetivo o registo de temperaturas obrigatrias das  para o HACCP de forma automatizada.
O registo ser feito e medido com sensores de Arduino e guardados numa base de dados.
A sua consulta ser feita atravs de uma pgina web. 
O sistema dever permitir enviar alertas caso haja, por exemplo, temperaturas fora dos parmetros definidos.
