INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (335, N'CGI Ambassadors', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Soluo que permita interligar embaixadores de organizaes, e que em funo de iniciativas e objetivos permita recompensar os mesmos atravs de pontos e aplicar conceitos de gamificao. Eventos que geram pontos que tm de ter aprovao.
Os rankings devero poder ser vistos por curso, ano, universidade ou global. A soluo dever tambm permitir atribuir desafios especficos aos embaixadores, dependendo da universidade, curso ou ano ou serem gerais para todos os embaixadores.  ', 90, N'Publicado', NULL, N'DEISI335', NULL, 1, N'p6255', NULL, N'p6255', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (336, N'CVTool - CV Capture data', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Soluo permite transformar toda a informao de um CV, de uma estruturada e otimizada e integrar a soluo de registo e pesquisa de  CVs.
Funcionalmente alm das buscas, dashboards sobre os perfis guardados, trabalhar dados guardados a gerao de um CV com base num formato/template pr-definido.', 90, N'Publicado', NULL, N'DEISI336', NULL, 0, N'p6255', NULL, N'p6255', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (337, N'One to One Spatial Translation vs Constrained Spaces: A study in locomotion and Cybersickness', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'One of the biggest challenges in VR is the conflict between the sense of movement and the lack thereof, leading to cybersickness and its symptoms (headaches, nausea, vertigo, or eyestrain). This work aims to compare this phenomenon to a one-to-one representation of the spatial navigation map, where the virtual space is directly mapped to the physical space. The goal is to observe if the physical movement can mitigate cybersickness or if other factors are at play (e.g., sampling rate or FoV).', 101, N'Publicado', NULL, N'DEISI337', NULL, 1, N'p5441', NULL, N'p5441', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (338, N'Mapping Physical Interaction with Virtual: a study on Haptics, Physical and Virtual Movement', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'VR interaction has limitations because no physical object or mass is present when interacting with Virtual Objects. This study intends to map virtual interaction with an actual physical object to understand if users feel a higher sense of immersion than traditional VR manipulation. The goal is to incorporate hand-tracking and motion capture techniques with VR with the purpose of constructing a one-to-one mapping between the physical and virtual interaction, such as opening a door.', 101, N'Publicado', NULL, N'DEISI338', NULL, 1, N'p5441', NULL, N'p5441', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (339, N'Numerical Performance of Scientific Programming Languages', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'This project aims to compare the numerical performance of five scientific programming languages/environments  Python/NumPy, R, MATLAB, Octave and Julia  under different operating systems  Linux, Mac, Windows  and hardware  single core and multicore CPUs. The software to be used for this purpose is already implemented in all the languages, consisting of a synthetic cluster generator. Results of this study aim to inform the scientific community of the pros and cons of the tested languages.', NULL, N'Publicado', NULL, N'DEISI339', NULL, 0, N'p5441', NULL, N'p5441', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (340, N'Landscaper Ants', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'This project aims to study the use of optimization algorithms such as Ant Colony Optimization, Artificial Bee Colony, Bat Algorithm and other nature-inspired algorithms to procedurally generate artificial landscapes similar to what one would find in real-life natural and man-made locations. A preliminary work employing Particle Swarm Optimization is available at https://www.mdpi.com/1099-4300/22/11/1284 (check the link to the vdeos).', NULL, N'A Aguardar Atribuio', NULL, N'DEISI340', NULL, 0, N'p5441', NULL, N'p5441', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (341, N'Aplicao de Inteligncia Artificial para estudo de prtica clnica inovadora', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Em parceria com o Centro de Medicina de Reabilitao de Alcoito, referncia de Excelncia internacional, propomos uma anlise e aplicao de inteligncia artificial para dados de um tratamento clnico inovador. O estudo dos dados resultantes da aplicao da Toxina Botulnica para leses do sistema nervoso central permitir conhecimento, at ento por explorar, para suporte clnico e apoio  deciso . Co-orientao da Prof. Maria Silva.', 100, N'Publicado', NULL, N'DEISI341', NULL, 3, N'p6949', NULL, N'p6949', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (342, N'Projeto de Machine Learning', N'2022', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Projeto no mbito de Data Science (com foco em Machine Learning) ainda por definir entre empresa e universidade.', 103, N'Recusado', NULL, N'Aluno342', N'Tem que existir contexto, tema ou orientador, de outra forma no  possvel avaliar o esforo esperado para TFC', 0, N'p2703', N'p2703', N'a21906962', 0, NULL)
