', 104, N'Publicado', NULL, N'DEISI343', NULL, 0, N'p5403', NULL, N'p5403', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (344, N'Analise de dados sobre a criminalidade em lisboa', N'2022', N'Recusado', NULL, N'2022-10-07', N'2022-10-07', N'Eu gostaria de desenvolver um projeto onde conseguisse analisar a criminalidade na regiao de lisboa, sabendo a que horas e em que zonas, os diferentes tipos de crimes so cometidos.', 10, N'Recusado', NULL, N'Aluno344', N'Tema interessante, mas no tem fundamentao suficiente para ser aceite. No so indicadas tecnologias, abordagem ao problema nem referncia a fontes para dados.  necessrio demonstrar viabilidade ou indicar orientador/entidade externa que a suportem', 0, N'p2703', N'p2703', N'a22103831', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (345, N'Estudo das chamadas de emergncia realizadas', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Este TFC tem como objetivo analisar as chamadas que so realizadas para o 112, de forma a poder-se perceber alguma da sua casustica que podero ser utilizadas na implementao de aes de otimizao dos recursos. 
Co-orientao: Iolanda Velho', 97, N'Publicado', NULL, N'DEISI345', NULL, 4, N'p6301', NULL, N'p6301', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (348, N'Plataforma de gesto para uma  lavandaria e engomadoria', N'2022', N'Aceite', NULL, N'2022-10-07', N'2022-10-07', N'Eu  tenho duas lojas destas e pretendemos criar uma plataforma que ajude a fazer a gesto da parte de engomadoria e tambm para gerir as mquinas de lavar e secar.
Pretendemos que a plataforma nos diga a disponibilidade das mquinas (se esto a ser utilizadas ou no.), queremos fazer uma rea onde trabalhadores podem logar as suas entradas e sadas, gerir as peas que entram para a engomadoria, estatsticas de quantas peas cada funcionrio passa por dia.', 98, N'Publicado', 116, N'G348', NULL, 1, N'p5617', N'p5617', N'a22004314', 0, NULL)
