Pretende-se que o ERP possa enviar mensagens, para entidades externas ou utilizadores, utilizando as ferramentas e recursos mais recentes (SMS, messenger, whatsapp, etc.)', 105, N'Publicado', NULL, N'DEISI352', NULL, 2, N'p2703', NULL, N'p2703', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (353, N'Sistema de Registo de Presenas', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'Criao de um sistema de marcao de presenas, que fizesse o registo de presenas dos alunos nas salas de aula, atravs das tecnologias Geolocalizao e QRCode', NULL, N'A Aguardar Aprovao', NULL, N'Aluno353', NULL, 0, NULL, NULL, N'a21006894', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (354, N'Aplicao MentHA', N'2022', NULL, NULL, N'2022-10-07', N'2022-10-07', N'O projeto MentHA - Mental Health and Aging (https://mentha-digital.herokuapp.com/) visa o treino cognitivo de adultos mais velhos com demncia. Pretende-se continuar o desenvolvimento das aplicaes desenvolvidas em TFCs anteriores. O trabalho ir consistir na integrao de novas funcionalidades, acompanhamento da sua aplicao nos parceiros do projeto (Cruz Vermelha Portuguesa, FamiliarMente,Elo Social,ASMAL,ADEB,GIRA) e introduo de melhorias sugeridas. Trabalho j atribuido.', 88, N'Publicado', NULL, N'DEISI354', NULL, 1, N'p6069', NULL, N'p6069', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (355, N'TASTE um IDE para Software de Satelites', N'2022', NULL, NULL, N'14/09/2023', N'10/07/2023', N'A Agncia Espacial Europeia (ESA) tem desenvolvido um Ambiente de Desenvolvimento Integrado (IDE) para software espacial, que suporta programao em Ada, C, SDL, Matlab/Simulink e outras linguagens. Este IDE chama-se TASTE (https://taste.tools/).

Neste TFC, os alunos iro adicionar melhorias ao IDE, nomeadamente aumentar o seu suporte para o desenvolvimento de vrias aplicaes em simultneo, e criando uma GUI prpria para esse fim.', 109, N'A Aguardar Atribuio', NULL, N'DEISI355', NULL, NULL, N'p6902', NULL, N'p6902', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (356, N'Modelo IA para codigo seguindo standard MISRA', N'2022', NULL, NULL, N'10/07/2023', N'10/07/2023', N'O MISRA (Motor Industry Software Reliability Association)  uma associao que estabelece diretrizes e melhores prticas para o desenvolvimento de software na indstria automotiva e em outros setores que requerem alta confiabilidade e segurana. MISRA C  o standard para desenvolver software em C.
O aluno  convidado a fazer uma modelo IA que analisa codigo C, e consegue o corrigir para ficar em linha com o MISRA.', 17, N'A Aguardar Atribuio', NULL, N'DEISI356', NULL, NULL, N'p6902', NULL, N'p6902', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (358, N'Plugin DP para Professores', N'2022', NULL, NULL, N'06/09/2023', N'06/09/2023', N'Pretende-se melhorar um plugin que permite aos professores interagir com o sistema Drop Project directamente a partir do IDE IntelliJ.

Este projecto j est atribudo ao aluno Joo Marques.
', NULL, N'A Aguardar Atribuio', NULL, N'DEISI358', NULL, NULL, N'p4453', NULL, N'p4453', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (359, N'Tratamento audio- podcasts', N'2022', NULL, NULL, N'13/09/2023', N'13/09/2023', N'Projeto numa linguagem adequada em Smart ou PC 
1 parte - aceitao de um file audio (mp3, aac, wav...) com discurso; utilizao das ferramentas google (speech e translate) para sacar a transcrio gerando-se um ficheiro de texto - *.srt.
2 parte - colocao em BD na nuvem do material recolhido: links para os files audio e ficheiro *.srt; app para tratamento desses dados: pesquisa, filtragem, etc. sobre palavras chave (nomes, anos, fontes...).
https://www.youtube.com/watch?v=AyzmS5WeIx4
', NULL, N'A Aguardar Atribuio', NULL, N'DEISI359', NULL, NULL, N'p1059', NULL, N'p1059', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (360, N'Gesto de Acessos - Academia Cristiano Ronaldo', N'2022', NULL, NULL, N'13/09/2023', N'13/09/2023', N'Pretende-se criao uma aplicao mvel para gesto de entradas e sadas dos atletas residentes na Academia Cristiano Ronaldo (Sporting Clube de Portugal). 
Atualmente os atletas tm que preencher um formulrio (em papel) solicitando a sada da Academia num determinado espao temporal. Este formulrio  depois entregue aos responsveis pelos atletas, que posteriormente aprovam, ou no, a sua sada. O objetivo deste trabalho  que todo este processo fosse automatizado.', 108, N'A Aguardar Atribuio', NULL, N'DEISI360', NULL, NULL, N'p5958', NULL, N'p5958', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (361, N'Continuous Integration Template for Qualified/Certified Projects', N'2022', NULL, NULL, N'14/09/2023', N'14/09/2023', N'Os projectos desenvolvidos em aeronautica e espao so validados sob standards e testes bastantes estritos.
Existe a possibilidade que quando se inicia um novo project nesta area, criar em github ou gitlab um processo CI por defeito que valida automaticamente o software produzido contra esses standards.
O aluno iria criar esse CI, que chamaria certos ferramentas de validacao e criar uma pequena demonstrao.', 17, N'A Aguardar Atribuio', NULL, N'DEISI361', NULL, NULL, N'p6902', NULL, N'p6902', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (362, N'Configurador Grafico de XML e Gerador de Cdigo Avinico', N'2022', NULL, NULL, N'14/09/2023', N'14/09/2023', N'Na area de avionica a configurao de software  descrita no formato XML. Dai  possive gerar esqueleto da aplicao. Neste TFC o aluno ira permitir o entendimento facil da descrio feita em XML, mostrando de uma forma grfica e simples. Assim o programador consegue facilmente ver erros da configurao e gerar sem problemas o cdigo respectivo.', NULL, N'A Aguardar Atribuio', NULL, N'DEISI362', NULL, NULL, N'p6902', NULL, N'p6902', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (363, N'Business Continuity Assessment Tool', N'2022', NULL, NULL, N'19/09/2023', N'19/09/2023', N'Software para avaliar o grau de maturidade de uma organizao em termos de Continuidade do Negcio.
Ao iniciar um programa de  Capacidade de Continuidade Organizacional, esta ferramenta examina se a organizao abordou os elementos fundamentais de um programa de continuidade para permitir o planeamento das operaes de continuidade de negcio. Esta app ser para avaliar um plano e programa de continuidade em relao aos requisitos para um programa e plano de continuidade vivel.', NULL, N'A Aguardar Atribuio', NULL, N'DEISI363', NULL, NULL, N'p6255', NULL, N'p6255', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (364, N'GPT ArgMine', N'2022', NULL, NULL, N'09/10/2023', N'09/10/2023', N'Este trabalho final de curso tem como foco o uso de tcnicas de aprendizagem de mquina em conjunto com o ChatGPT para extrair argumentos em conversas de grupo entre estudantes no ensino secundrio. O objetivo  desenvolver um sistema capaz de classificar argumentos em conversas educativas. Ao analisar e entender os argumentos apresentados em tais conversas, este projeto visa fornecer insights valiosos sobre a dinmica e eficcia da colaborao estudantil em ambientes de aprendizagem online.', NULL, N'A Aguardar Atribuio', NULL, N'DEISI364', NULL, NULL, N'p5265', NULL, N'p5265', 0, NULL)
INSERT [dbo].[TFC] ([id], [Titulo], [anoLetivo], [avaliacaoProposta], [coorientador], [dataEstado], [dataProposta], [descricao], [entidade], [estado], [idGrupo], [idtfc], [motivoRecusa], [numeroInscricoes], [orientador], [orientadorProposto], [preponente], [semestre], [tecnologias]) VALUES (365, N'ALQI-DR: tutor inteligente para estudar interaes mediadas por algoritmos.', N'2022', NULL, NULL, N'09/10/2023', N'09/10/2023', N'O projeto pretende implementar p crebro de um tutor inteligente que funciona como um agregador interativo de notcias . Esta ferramenta educacional no apenas serve como uma plataforma para disseminao de notcias, mas tambm oferece uma oportunidade nica para examinar de perto as interaes e comportamentos de jovens indivduos dentro desses ecossistemas de informaes algortmicas.', NULL, N'A Aguardar Atribuio', NULL, N'DEISI365', NULL, NULL, N'p5265', NULL, N'p5265', 0, NULL)
